INSERT INTO `qn_posts` VALUES ('1182', '3', '2014-08-21 17:02:33', '2014-08-21 17:02:33', 'Warranty Info:<br /><br />The following electrical parts on the Qnique Grace Sewing Machine System have a 1-year limited warranty:\r\n<br />\r\n<ul>\r\n    <li>Front Handles/Buttons</li>\r\n    <li>LCD, Encoders</li>\r\n    <li>Laser</li>\r\n    <li>Stitch Regulator</li>\r\n    <li>Cables</li>\r\n    <li>Power Supply</li>\r\n    <li>Motor</li>\r\n    <li>All other wiring and electronics.</li>\r\n</ul>\r\n<br />\r\n<strong>The Grace Company guarantees these electrical parts against manufacturing defects for the first year of ownership on all Qnique models.<br /></strong>\r\n<br />\r\nThe Grace Company warrants all non-moving, non-electric, mechanical parts on the Qnique Quilting Machine against mechanical failure due to manufacturing defects for up to 2 years after initial purchase.<br /><br />The Grace Company warrants the cast metal body of the Qnique Quilting Machine to be free of defects or imperfections causing product failure for up to 5 years after initial purchase. <br /><br />\r\nThis means <strong class=\"StrictlyAutoTagBold\">Grace Company</strong> will replace parts that they deem to be faulty, or that fail due to what the Grace Company determines to be manufacturing defects. The customer pays all shipping and labor fees. The warranty period begins at the date of purchase. The warranty does not transfer to a secondary owner.\r\nAny parts damaged by the customer do require payment.<br />\r\n<br />\r\nThe Warranty period begins at the time of the customers purchase from <strong class=\"StrictlyAutoTagBold\">Grace Company</strong> or a dealer (not from the time of the dealers purchase). Customer proof of purchase should be obtained if no warranty card for the customer exists.\r\n<p><strong>Warranty Exclusions:</strong> The warranty does not apply to any costs, repairs, or services for repairs necessitated by use other than normal home use, or damage resulting from misuse, abuse, accidents, alterations, or lack of proper machine maintenance.</p>\r\n\r\n', 'Warranty Info', 'The Grace Machine Systems limited warranty Information', 'publish', 'closed', 'closed', '', 'warranty-info', '', '', '2015-05-04 08:12:31', '2015-05-04 14:12:31', '', '2905', 'http://www.qniquequilter.com/?page_id=1182', '8', 'page', '', '0');
