INSERT INTO `qn_posts` VALUES ('1187', '3', '2014-08-21 17:34:20', '2014-08-21 23:34:20', '<h2>Refund Policy</h2><p><span>http://www.qniquequilter.com may, but are under no obligation to, honor requests for refunds for the following reasons:</span><br /><br /><span>Non-delivery of the product: Due to an issue with the mail or courier service, you do not receive a delivery e-mail from us. Depending on the price of the product, http://www.qniquequilter.com may require you to first submit proof that you have submitted a report to the mail service or courier company describing the missing item;</span><br /><br /><span>Download issues: You have problems that prevent you from downloading the product. http://www.qniquequilter.com recommends that you contact the support team for your browser provider, as http://www.qniquequilter.com ensures that our software can be downloaded with all major browsers, and this problem usually arises from a customer\'s issue with either their browser, firewall, or network;</span><br /><br /><span>Irreparable defects with the software or machinery: Although all the products are thoroughly tested before release, unexpected errors may occur. This reason should be submitted to our Support Team for its approval of your refund request;</span><br /><br /><span>Product not-as-described: A request based on this reason is addressed on a case-by-case basis and subject to our approval. To prevent this kind of claim from arising, every customer is encouraged to check free samples ( in the form of video overviews, demo links, product samples, screen shots) of each type of the product offered before making a purchase.</span><br /><br /></p><h2>Return Policy</h2><p><br />All returns require a Return Merchandise Authorization Number, which you should be given upon notification of your return. <br />Please reference this number on your returned item. <br />A restocking fee of up to 25% may apply to used, non-defective returns.\r\n</p><br />\r\n<em><strong>*The customer is responsible for all shipping costs.</strong></em>\r\n<br />\r\n<p>**<strong class=\"StrictlyAutoTagBold\">Grace Products</strong> purchased from our dealers are subject to the Dealers refund policies. However, with our warranty we stand behind our products warranties, whether purchased direct from us or any of our reputable dealers (see below). We also handle all part replacement and technical support direct. Simply call us toll-free, for technical support and replacement parts needs.</p>\r\n<br />\r\n<h3>International Shipping</h3>\r\n<p>GraceWood INC, is not responsible for any custom, duties, brokerage, taxes, or any other charges that may occur with International shipping</p>', 'Return Policy', 'Qnique Quilter Return Policy Information', 'publish', 'closed', 'closed', '', 'return-policy', '', '', '2015-04-23 13:01:23', '2015-04-23 19:01:23', '', '2905', 'http://www.qniquequilter.com/?page_id=1187', '5', 'page', '', '0');
