INSERT INTO `qn_posts` VALUES ('1347', '1', '2014-09-03 19:40:15', '2014-09-04 01:40:15', '<p><strong>Qnique 14+ Quilting Frame:</strong></p>\r\n<ul class=\"pricing-list\" style=\"color: #555555;\">\r\n    <li>Sets up in sizes: King, Crib</li>\r\n    <li>Framelength: 66to 110Inches</li>\r\n    <li>Quilt sizes up to 104 inches</li>\r\n    <li>Optional 4th rail available</li>\r\n    <li>Height-adjustable legs</li>\r\n    <li>Dual-wheel track for improved carriage motion</li>\r\n    <li>Easy to assembly &amp; user-friendly</li>\r\n</ul>\r\n<p><br />TheQnique 14+ Quilting Frame is designed specifically for the Qnique Quilting Machine. The frameutilizes cast-alloy components, which make it stronger and lighter than previous frames. Standard Height-adjustable legs let you adjust the level of the frame, so that quilting is more comfortable and less awkward. <br /><br /> <strong>Qnique 14+ Mid Arm Machine:</strong><br />This new affordable mid-arm quilter is loaded with professional features normally reserved for more expensive quilting machines.</p>\r\n<ul class=\"pricing-list\" style=\"color: #555555;\">\r\n    <li>15 inch throat space</li>\r\n    <li>Built-in stitch regulator</li>\r\n    <li>4 different stitch modes</li>\r\n    <li>Convenient quick-access handle buttons</li>\r\n    <li>Full-color OLED screen</li>\r\n    <li>Stitch Speeds up to 1,800 stitches per minute</li>\r\n</ul>\r\n<p><br /> <a class=\"small-action-button\" href=\" http://www.qniquequilter.com/features/\">See Full Machine Details</a></p>', 'Qnique Quilting Frame Combo', 'The new Qnique 14+ Quilting Frame is designed specifically to accommodate the Qnique Quilting Machine. Get both the frame and the machine together in this amazing combo for the ultimate quilting experience!', 'publish', 'open', 'closed', '', 'qnique-quilting-frame-combo', '', '', '2016-02-03 10:26:45', '2016-02-03 17:26:45', '', '0', 'http://www.qniquequilter.com/?post_type=product&#038;p=1347', '1', 'product', '', '0');
