INSERT INTO `qn_posts` VALUES ('1364', '3', '2014-09-04 19:05:55', '2014-09-05 01:05:55', '<h3>The SR-2 Quilting Frame</h3>The SR2 Machine Quilter offers a high-quality machine <strong class=\"StrictlyAutoTagBold\">quilting frame</strong> at an affordable price. This is the first of our frames to feature 2 rails and the new Quilt-Clasps for easy fabric control. Just clip the Quilt-Clasps to the quilt and rail for even tension without having to roll the fabric.\r\n<br />\r\n<ul>\r\n    <li>Sets up in sizes: Queen or Crib</li>\r\n    <li>Length: 53 to 103 inches</li>\r\n    <li>Sturdy steel construction</li>\r\n    <li>Included Quilt-Clips for easiest fabric tension and control</li>\r\n</ul>\r\n<br />\r\n<h3>Qnique 14+ Mid Arm Machine:</h3><span>This new affordable mid-arm quilter is loaded with professional features normally reserved for more expensive <strong class=\"StrictlyAutoTagBold\">quilting machines</strong>.</span>\r\n<br />\r\n<ul style=\"color: #555555;\">\r\n    <li>15 inch throat space</li>\r\n    <li>Built-in stitch regulator</li>\r\n    <li>4 different stitch modes</li>\r\n    <li>Convenient quick-access handle buttons</li>\r\n    <li>Full-color OLED screen</li>\r\n    <li>Stitch Speeds up to 1,800 stitches per minute</li>\r\n</ul>\r\n<br /><a href=\" http://www.qniquequilter.com/features/\" class=\"small-action-button\">See Full Machine Details</a>', 'SR-2 Frame Combo', '<p>Get a complete quilting system at an amazing price with the Sr-2 and Qnique Quilter Combo!</p><p>UPC636343172670</p><!--mep-nl-->', 'publish', 'open', 'closed', '', 'sr-2-frame-combo', '', '', '2016-02-03 10:25:53', '2016-02-03 17:25:53', '', '0', 'http://www.qniquequilter.com/?post_type=product&#038;p=1363', '11', 'product', '', '0');
