INSERT INTO `qn_posts` VALUES ('1460', '4', '2014-09-19 14:29:24', '2014-09-19 20:29:24', '<h2>Q\'nique Quilter 14+Ruler Base Accessory</h2><span>Add this sturdy ruler base when <strong class=\'StrictlyAutoTagBold\'>machine quilting</strong> on your frame to use quilting rulers, straight-edges and templates. This can beeasilyattached to and removed from your Qnique machine. The ruler base adds a stable surface around the needle, under the quilt, so you can use templates and rulers in ways that would not be possible on fabric alone.<br /><br />The ruler base is made of a clear acrylic and is inch thick, providing stability with a low profile. </span>', 'Qnique Ruler Base', 'Use quilting rulers, guides and templates with your Grace Qnique by adding this ruler base to your quilting machine. It adds a level, sturdy extension to the base of your quilting machine when using a quilting frame. The ruler base is very easy to attach and remove.', 'publish', 'open', 'closed', '', 'qnique-ruler-base', '', '', '2016-07-29 16:42:12', '2016-07-29 22:42:12', '', '0', 'http://www.qniquequilter.com/?post_type=product&#038;p=1460', '9', 'product', '', '0');
