INSERT INTO `qn_posts` VALUES ('1463', '4', '2014-09-19 15:26:56', '2014-09-19 21:26:56', '&lt;h2&gt;Q&#039;niqueLaser Stylus&lt;/h2&gt;Theeasiest way to trace patterns when quilting is with the &lt;strong class=&#039;StrictlyAutoTagBold&#039;&gt;Qnique Laser Stylus&lt;/strong&gt;. Just place a paper pattern off to the side and follow along with the precise laser indicator. Even copy patterns you&#039;ve already quilted without a paper template! The Laser stylusplugs right into the Qniques accessory ports, so there are no batteries to buy or replace.&lt;br /&gt;&lt;br /&gt;The laser is designed for maximum versatility and can be attached to the front or rear handles, or near the bottom of the quilting machine, between the wheels, with the included adapter. Once attached, the laser can be rotated or positioned in any angle.&lt;br /&gt;&lt;br /&gt;', 'Qnique Laser Stylus', 'The Qnique Laser Stylus is the easiest way to trace patterns or photographs whilequilting on a machine quilting frame. Just attach the laser stylus to the Qnique Quilting Machine, and position it to trace the desired pattern so you can follow along! The laser can be attached to the front or rear handles, or even on the bottom of the machine, between the wheels.', 'publish', 'open', 'closed', '', 'qnique-laser-stylus', '', '', '2015-03-02 17:04:32', '2015-03-03 00:04:32', '', '0', 'http://www.qniquequilter.com/?post_type=product&#038;p=1463', '10', 'product', '', '0');
INSERT INTO `qn_posts` VALUES ('1464', '4', '2014-09-19 13:10:44', '2014-09-19 19:10:44', 'The Qnique Laser Stylus can be attached to the handles', 'laser-on-handles-short', '', 'inherit', 'open', 'open', '', 'laser-on-handles-short', '', '', '2014-09-19 13:11:35', '2014-09-19 19:11:35', '', '1463', 'http://www.qniquequilter.com/wp-content/uploads/2014/09/laser-on-handles-short.jpg', '0', 'attachment', 'image/jpeg', '0');
INSERT INTO `qn_posts` VALUES ('1465', '4', '2014-09-19 13:10:46', '2014-09-19 19:10:46', 'The Qnique Laser Stylus can also be attached to the bottom of the machine.', 'laser-on-base', '', 'inherit', 'open', 'open', '', 'laser-on-base', '', '', '2014-09-19 13:12:09', '2014-09-19 19:12:09', '', '1463', 'http://www.qniquequilter.com/wp-content/uploads/2014/09/laser-on-base.jpg', '0', 'attachment', 'image/jpeg', '0');
INSERT INTO `qn_posts` VALUES ('1466', '4', '2014-10-04 14:25:52', '2014-10-04 20:25:52', '<h2>Q\'nique Bobbin Case</h2>This bobbin case is made of a high-quality aluminum and is made to fit perfectly for the Qnique 14+ Mid-Arm Quilting Machine. It holds the large M-Class bobbin used by the Qnique.', 'Qnique Bobbin Case', 'High-grade aluminum bobbin case for the Qnique Quilter 14+ Quilting Machine', 'publish', 'open', 'closed', '', 'qnique-bobbin-case', '', '', '2015-01-07 11:40:11', '2015-01-07 18:40:11', '', '0', 'http://www.qniquequilter.com/?post_type=product&#038;p=1466', '5', 'product', '', '0');
