INSERT INTO `qn_posts` VALUES ('1469', '4', '2014-09-19 15:27:53', '2014-09-19 21:27:53', '<h2>Qnique Quilting Machine Rear Handle</h2>Work from the back of your <strong class=\"StrictlyAutoTagBold\">quilting frame</strong> with these quilting machine rear handles for the Qnique Quilter! This quilting accessory is essential if you plan on using any pantographs or patterns from the back table of your machine <strong class=\"StrictlyAutoTagBold\">quilting frame</strong>. These rear handles feature the same quick access buttons as you regular quilting handles, and even provide a connection for the LCD display, so you can control all of the Qnique Quilter\'s functions and settings right from the rear of the machine.', 'Qnique Rear Handles', 'Double the ways you can quilt with your Grace Qnique by adding rear handles! These let you work from the back of the machine on a quilting frame, and are a must if wish to follow pantograph patterns or the Plastic Pattern Perfect templates from the back of the quilting machine.<p>', 'publish', 'open', 'closed', '', 'qnique-quilting-machine-rear-handles', '', '', '2016-04-27 19:31:54', '2016-04-28 01:31:54', '', '0', 'http://www.qniquequilter.com/?post_type=product&#038;p=1469', '8', 'product', '', '0');
