INSERT INTO `qn_posts` VALUES ('1473', '4', '2014-09-25 13:14:26', '2014-09-25 19:14:26', 'These quilting machine needles are available in either size 16 or 18.', 'Longarm Quilting Machine Needles', 'Quilting machine sewing neeldes. These are made from a high quality steel and are available in either size 16 or 18. Each package comes with 10 needles. These will work with most longarm quiltng machines. ', 'publish', 'closed', 'closed', '', 'grace-longarm-quliting-machine-needles', '', '', '2016-07-05 10:46:43', '2016-07-05 16:46:43', '', '0', 'http://www.qniquequilter.com/?post_type=product&#038;p=1473', '6', 'product', '', '0');
