INSERT INTO `qn_posts` VALUES ('1476', '4', '2014-10-04 14:27:05', '2014-10-04 20:27:05', '<h2>Grace Quilting Machine M-Class Bobbins</h2>These large M-Class bobbins are designed to hold more thread than a regular bobbin, letting you quilt longer without needing to change it. They come in a pack of 10 bobbins and are made of a high-quality aluminum. These will work with most <strong class=\"StrictlyAutoTagBold\">longarm quilting</strong> machines.', 'M-Class Bobbins', 'A set of 10 M-class bobbins. These are made of a high-quality aluminum and will work with most longarm quilting machines.', 'publish', 'open', 'closed', '', 'grace-quilting-machine-m-class-bobbins', '', '', '2016-07-05 10:44:03', '2016-07-05 16:44:03', '', '0', 'http://www.qniquequilter.com/?post_type=product&#038;p=1476', '4', 'product', '', '0');
