INSERT INTO `qn_posts` VALUES ('1478', '4', '2014-09-22 11:48:40', '2014-09-22 17:48:40', '<h2>Grace Company Brand Start-Right Cloth Leaders</h2>\r\nA time-saving product to help you attach your fabric to your frame easily, and accurately. Includes three king cloth leaders printed with precise guide marks and pin lines. It works great with our Fabri-Fast system, but also includes a Velcro attachment kit that can be used to secure the cloth leaders to your frame. \r\n \r\nChoose the size that\'s best for your frame. 136\" is great for a Majestic with the extra 2 foot extension. 124\" is good for a <strong class=\'StrictlyAutoTagBold\'>Gracie King</strong>. The 112\" cloth leader is good for the normal Majestic and smaller frames. If you have a crib size frame, you may need to get a 112\" size and then cut it down. \r\n \r\ntag: quilting frame cloth leaders', 'Cloth Leaders | Grace Quilting Frame', '<strong>Grace Quilting Frame Cloth Leaders </strong>\r\n<ul><li>Works for machine frames or hand frames</li><li>Includes three cloth leaders for the top three rails</li><li>Includes a Velcro attachment kit</li><li>Available in 3 sizes: 136\", 124\", and 112\"</li></ul>', 'publish', 'open', 'closed', '', 'grace-quilting-frame-cloth-leaders', '', '', '2016-07-05 10:55:00', '2016-07-05 16:55:00', '', '0', 'http://www.qniquequilter.com/?post_type=product&#038;p=1478', '7', 'product', '', '0');
