INSERT INTO `qn_posts` VALUES ('1518', '3', '2014-09-24 17:59:38', '2014-09-24 23:59:38', '<h2 itemprop=\"name headline\">Q\'nique Early Release</h2>\r\n<h3 itemprop=\"name\">Sewing Machines Plus</h3>\r\n<p>We wanted to make sure and update everyone that <a rel=\"nofollow\" itemprop=\"url\" href=\"http://www.sewingmachinesplus.com/qnique-long-arm-quilter.php\" qnique=\"\" on=\"\" sewingmachinesplus=\"\">Sewing Machines Plus</a>, one of our key retail dealers, has fully launched the New Qnique Quilting Machine. No, this is not a new Long Arm machine but a brand new mid arm sewing machine by the Grace Company. The new Grace Machine contains several features that are normally reserved and only found on more expensive long arm machines. Stitch regulation with both precise and cruise mode, basting stitch with adjustable length and manual modes give you full control of your stitching.</p>\r\n\r\n<p>With every piece of the quilting machine being designed for its specific form and function, quilters of all ages will find that the Grace machine will give them the ability to complete their projects with ease. Both left and right handed users can easily switch the controls to best suit their needs. Ergonomic handles allow the quilter to use it for hours on end minimizing fatigue and strain on the hands. All functions are available at the touch of a button and located on the tips of the handles.</p>\r\n\r\n<p>The Grace Qnique Quilter will work with several of the Grace frames but is best paired with the new full featured Qnique Frame that is made by <a itemprop=\"url\" href=\"http://www.graceframe.com/\" the=\"\" grace=\"\" company=\"\">the Grace Company</a>. Other accessories like the laser stylus, ruler base and rear handle bars can also be added to the quilting machine.<br /><br />Author link: <a rel=\"nofollow\" itemprop=\"url\" href=\"http://www.sewingmachinesplus.com/qnique-long-arm-quilter.php\" title=\"Qnique on Sewing Machines Plus\" target=\"_blank\"><span itemprop=\"name\">http://www.sewingmachinesplus.com/qnique-long-arm-quilter.php</span></a></p>\r\n\r\n\r\n\r\n<span itemprop=\"Keywords\">Sewing machine </span>, <span itemprop=\"Keywords\">Quilting machine</span>, <span itemprop=\"Keywords\">Grace machine</span>, <span itemprop=\"Keywords\">Qnique machine</span>, <span itemprop=\"Keywords\">Mid arm</span>, <span itemprop=\"Keywords\">Long arm</span>, <span itemprop=\"Keywords\">Mid-Arm Machine Quilter<br /><br /><br />Join our community poll and tell us your favorite quilting machine! @ <a rel=\"nofollow\" itemprop=\"url\" href=\"http://www.topix.com/forum/hobbies/quilting/T748GKFD6FIB8RFTN\" title=\"topix poll for favorite quilting machine\" target=\"_blank\">Topix Quilting Machine Poll</a><br /><br /><a rel=\"nofollow\" itemprop=\"url\" href=\"http://www.topix.com/forum/hobbies/quilting/T748GKFD6FIB8RFTN\" title=\"topix poll for favorite quilting machine\" target=\"_blank\">[responsive imageid=\'1520\' size1=\'0\' size2=\'600\' size3=\'1000\']<br /></a></span>', 'Qnique Quilting Machine Pre-Release', 'We wanted to make sure and update everyone that Sewing Machines Plus, one of our key retail dealers, has fully launched the New Qnique Quilting Machine. ', 'publish', 'open', 'open', '', 'qnique-quilting-machine-pre-release', '', '', '2014-09-24 18:03:57', '2014-09-25 00:03:57', '', '0', 'http://www.qniquequilter.com/?p=1518', '20', 'post', '', '0');
