INSERT INTO `qn_posts` VALUES ('1653', '3', '2014-10-14 17:17:30', '2014-10-14 23:17:30', '<h2>Computer Automated Quilting</h2>\r\n<h3>Powered by QuiltCAD</h3>\r\n<p>Enjoy the benefits of a professional automated quilting system in the comfort of your own home! You design it, QuiltMotion quilts it! QuiltMotion takes you seamlessly through pattern design to stitching with absolute ease.</p>\r\n[br]\r\n[responsive imageid=\'1654\' size1=\'0\' size2=\'600\' size3=\'1000\']\r\n[br]\r\n<p>Different versions of QuiltMotion have been designed for different branded sewing machines. Contact your sewing machine dealer to see if they have a QuiltMotion for your machine.</p>\r\n[br]\r\n\r\n<h4 class=\"callush4\" style=\"text-align: center;color:#ff0017;\">Call for availability and pricing</h4>\r\n<h2 class=\"callush2\" style=\"text-align: center;color:#ff0017;\">1-800-264-0644</h2>\r\n[br]\r\n[br]\r\n<div class=\"vc_separator wpb_content_element vc_separator_align_center vc_el_width_100 vc_sep_color_blue xraysep\">\r\n	<span class=\"vc_sep_holder vc_sep_holder_l\">\r\n		<span class=\"vc_sep_line\">\r\n		</span>\r\n	</span>\r\n	<h4>QuiltMotion Inside &amp; Out</h4>    \r\n	<span class=\"vc_sep_holder vc_sep_holder_r\">\r\n		<span class=\"vc_sep_line\">\r\n		</span>\r\n	</span>\r\n</div>\r\n\r\n\r\n<div id=\"sorting-advanced_wrapper\" class=\"dataTables_wrapper\" role=\"grid\">\r\n	<div class=\"dataTables_header\">\r\n		<div class=\"dataTables_length\" id=\"sorting-advanced_length\">\r\n			<label>\r\n				Product Features\r\n			</label>\r\n		</div>\r\n		<div id=\"sorting-advanced_filter\" class=\"dataTables_filter\">\r\n		</div>\r\n		<table aria-describedby=\"sorting-advanced_info\" class=\"table responsive-table responsive-table-on dataTable\" id=\"sorting-advanced\">\r\n			<thead>\r\n				<tr role=\"row\">\r\n					<th aria-label=\"Text: activate to sort column ascending\" style=\"width: 708px;\" colspan=\"1\" rowspan=\"1\" aria-controls=\"sorting-advanced\" tabindex=\"0\" role=\"columnheader\" class=\"sorting\" scope=\"col\">Details</th>\r\n				</tr>\r\n			</thead>\r\n <tbody aria-relevant=\"all\" aria-live=\"polite\" role=\"alert\">	\r\n<td>Comes with the motor plate and hardware needed to control you machine</td> \r\n<td>Includes pattern library with 200 quilt-ready patterns</td> \r\n<td>Create your own patterns or trace them from photographs</td> \r\n<td>Design and edit blocks, pantographs, borders, and full quilt layouts</td> \r\n<td>Included LCD display for convenient control right at your sewing machine</td> \r\n<td>Precise pattern placement methods</td> \r\n<td>See your pattern in relation to your quilt on-screen before you begin quilting</td> \r\n<td>Record and save any free-hand quilted patterns to use or edit later</td> \r\n<td>Easily switch between computer guided quilting and free-hand quilting</td> \r\n<td>Import a wide variety of pattern file types from other programs</td> \r\n<td>For Windows 8, 7, Vista, and XP</td>\r\n</tbody>\r\n\r\n			<tfoot>\r\n				<tr>\r\n					<td rowspan=\"1\" colspan=\"6\"> </td>\r\n				</tr>\r\n			</tfoot>\r\n		</tr>\r\n	</table>\r\n	<div class=\"dataTables_footer\">\r\n		<div id=\"sorting-advanced_info\" class=\"dataTables_info\">CALL US FOR MORE SPECIFIC INFORMATION</div>\r\n	</div>\r\n</div>\r\n</div>\r\n<br style=\"clear:both;\" />\r\n\r\n[br]\r\n\r\n<br>\r\n\r\n\r\n\r\n\r\n\r\n&nbsp;\r\n\r\n\r\n\r\n[icoonbox category=\"129\" layout=\"grid\" columns=\"2\" style=\"style2\" border=\"disabled\" boxboxed=\"enabled\" boxbgcolor=\"#ffffff\" boxesborder=\"enabled\" boxesbordercolor=\"#DCDCDC\" boxborderradius=\"itemNoRadius\" hoverboxesbgcolor=\"#1e73be\" icontype=\"fontIcon\" iconsize=\"iconsize_32\" iconcolor=\"#008dce\" iconboxed=\"enabled\" iconbgcolor=\"transparent\" iconborder=\"enabled\" iconbordercolor=\"#008dce\" iconborderradius=\"iconSmallRadius\" hovericonbgcolor=\"#ff0017\" hovericoncolor=\"#ffffff\" orderby=\"date\" order=\"DESC\" fontstyle=\"custom\" titlefontcolor=\"#008dce\" titlefontsize=\"24px\" titlefontweight=\"bold\" textfontcolor=\"#777777\" textfontsize=\"12px\" morelink=\"disabled\" hovereffect=\"effect4\" hovertitlecolor=\"#ffffff\" hoverdescriptioncolor=\"#ffffff\" ]', 'Quilter\'s Creative Touch with QuiltMotion', 'Quilter\'s Creative Touch with QuiltMotion, Grace Company Computer Automated Quilting hardware and software package Powered by QuiltCAD', 'draft', 'closed', 'closed', '', 'quiltmotion', '', '', '2016-02-01 10:02:59', '2016-02-01 17:02:59', '', '1969', 'http://www.qniquequilter.com/?page_id=1653', '3', 'page', '', '0');
