INSERT INTO `qn_posts` VALUES ('1656', '1', '2014-10-14 17:08:40', '2014-10-14 23:08:40', '<h3>Computer Automated Quilting</h3><br />\r\n<h3>Powered by QuiltCAD</h3><br />\r\n<p>Enjoy the benefits of a professional automated quilting system in the comfort of your own home! You design it with Quilter\'s Creative Touch, and QuiltMotion quilts it! Go seamlessly through pattern design to stitching with absolute ease.</p><br />\r\n<a href=\" http://www.qniquequilter.com/quiltmotion/\" class=\"small-action-button\" target=\"_blank\">See Full Details</a>', 'Quilters Creative Touch with QuiltMotion', '<b>Computer Automated Quilting<br /></b>\r\n<i>Powered by QuiltCAD<br /></i>\r\nWith Quiltmotion Software you will enjoy the benefits of a professional automated quilting system in the comfort of your own home! You design it, QuiltMotion quilts it! QuiltMotion takes you seamlessly through pattern design to stitching with absolute ease.', 'publish', 'open', 'closed', '', 'quiltmotion', '', '', '2015-02-26 14:33:08', '2015-02-26 21:33:08', '', '0', 'http://www.qniquequilter.com/?post_type=product&#038;p=1656', '3', 'product', '', '0');
