INSERT INTO `qn_posts` VALUES ('1690', '7', '2014-10-27 18:35:39', '2014-10-28 00:35:39', 'Quilting is a tradition that has been around for hundreds of years, and anyone who has seen a quilt up close knows the intricacies of the work involved in putting the quilt together. While many quilts have been painstakingly done by hand, today\'s quilts can be done using sewing machines equipped with the latest technology. Adapted to accommodate the large size of quilts, these machines make the task of creating these fabric masterpieces easier than ever before. For those who are serious about their quilting, there is no better machine to use than the Qnique Quilting Machine by the Grace Company.\r\n\r\n<h2>Why Choose the Qnique?</h2>\r\n\r\nThe Qnique Quilting Machine, designed to make quilting easier for both beginning and experienced quilters, comes equipped with a variety of features. One of the most popular features is the extended height and length of the work area. This allows a quilter to work on larger patterns and blocks, offering a 15-inch throat space from the needle to the back of the work area. Designed to be the latest model in the mid-arm quilting world, the Qnique has been adapted to include the latest computerized technology. The Quiltmotion hardware and Creative Touch software will work together to provide an experience unlike any other. Controlling the machine can literally be done at one\'s fingertips, as the Qnique is the only machine on the market with six quick-access buttons on the handles. \r\n\r\n<h2>Quilting Frames</h2>\r\n\r\nAs any serious quilter knows, having the right combination of machine and frame go far in determining the quality of the quilt. For those who already own a quilting frame, the Qnique has been designed to work effortlessly with many existing frames. However, for quilters who want to combine a Qnique Quilting Machine with frames specially designed for the Qnique, there are several frame packages available. Two of the most popular packages include:\r\n<ul>\r\n<li>SR-2 Quilting Frame</li>\r\n<li>Qnique 14+ Quilting Frame</li></ul>\r\n\r\n<strong>Many customers prefer the Qnique 14+ Quilting Frame because it is a king-size frame, enabling it to handle much larger quilts and provide plenty of work space.</strong>\r\n\r\n<h2>Call Grace Today</h2>\r\n\r\nWith many pricing options and quilting packages available to customers, the Grace Company is the first and only choice for those who understand what\'s needed to create the perfect quilt. Industrial-strength machines that are user-friendly and come complete with built-in stitch regulation set Grace Qnique Quilting Machines apart from any others. When you want the best from the best, purchasing a Qnique Quilting Machine from the Grace Company is the smart choice.', 'Qnique Quilting Machine', 'Qnique Quilting Machine  Adapted to accommodate the large size of quilts, these machines make the task of creating these fabric masterpieces easier than ever before.  For those who are serious about their quilting, there is no better machine to use than the Qnique Quilting Machine by the Grace Company.', 'publish', 'open', 'closed', '', 'qnique-quilting-machine', '', '', '2015-01-14 11:02:51', '2015-01-14 18:02:51', '', '0', 'http://www.qniquequilter.com/?p=1690', '16', 'post', '', '7');
