INSERT INTO `qn_posts` VALUES ('1700', '3', '2014-10-28 12:16:48', '2014-10-28 18:16:48', '<p>Creating a quilt can be one of the most beautiful crafting activities, but it can also be one of the most tedious. When looking at quilts that were made entirely by hand generations ago, it\'s hard to imagine how much time and effort it took. Fortunately, technology has advanced to the point of creating equipment that makes doing even the biggest and most complex quilt easier than ever. For many quilters, a mid-arm machine such as the Qnique Quilter works best for their projects. Allowing for work on projects that earlier would have required a long-arm machine, these machines offer a variety of features that make sewing even the most complex quilt a pleasure.</p>\r\n \r\n<h2 itemprop=\"hasPart about\">Advantages of a Mid Arm Quilting Machine</h2>\r\n<p>For those quilters who want plenty of work space packed into a smaller machine, the Qnique Quilter does just that. A mid arm quilting machine offers numerous advantages over traditional long arm machines, such as:</p>\r\n<ul>\r\n<li>Extended Work Area</li>\r\n<li>Multiple Accessory Ports</li>\r\n<li>Dual Thread Towers</li>\r\n<li>Built-in Stitch Regulation</li>\r\n</ul>\r\n \r\n<p>In addition, a mid arm quilting machine is easier to control due to its quick-access buttons that allow for all functions of the machine to be controlled from its two handles, each of which contain three function buttons.</p>\r\n \r\n<h2 itemprop=\"hasPart about\">The Technology of Quilting</h2>\r\n<p>What make today\'s quilts so much easier to make are the advances in technology. With computer automated software such as Quiltmotion available on these machines, the possibilities are endless when it comes to the patterns and styles that can be used on modern quilts. Whether working on a standard block or one that\'s a little bigger, a mid arm quilting machine can do the job every time.</p>\r\n \r\n<h2 itemprop=\"hasPart about\">Mid Arms and Quilting Frames</h2>\r\n<p>For many quilters, one of their biggest problems is finding a machine that fits well with their quilting frame. With a mid arm machine such as the Qnique Quilter, this is never an issue. The Grace Company, which is considered the pioneer of quilting frames, offers two frames that work well with mid arm machines. The SR-2 sets up in Queen or Crib size, while the recently-developed Qnique 14+ frame is a king-size version designed specifically for larger quilts.</p>\r\n \r\n<p>Making the best quilt takes the right combination of skill, style and patience along with the best equipment. For beginners as well as experienced quilters, using a mid arm quilting machine such as the Qnique Quilter can help turn an ordinary quilt into a true masterpiece.</p>', 'Mid Arm Quilting Machine', 'Mid Arm Quilting Machine - Making the best quilt takes the right combination of skill, style and patience along with the best equipment. ', 'publish', 'open', 'closed', '', 'mid-arm-quilting-machine', '', '', '2015-03-23 14:35:43', '2015-03-23 20:35:43', '', '0', 'http://www.qniquequilter.com/?p=1700', '13', 'post', '', '0');
INSERT INTO `qn_posts` VALUES ('1702', '1', '2014-10-28 12:15:36', '2014-10-28 18:15:36', 'For beginners as well as experienced quilters, using a mid arm quilting machine such as the Qnique Quilter can help turn an ordinary quilt into a true masterpiece.\n', 'midarm-banner', '', 'inherit', 'open', 'open', '', 'midarm-banner', '', '', '2014-10-28 12:15:54', '2014-10-28 18:15:54', '', '1700', 'http://www.qniquequilter.com/wp-content/uploads/2014/10/midarm-banner.jpg', '0', 'attachment', 'image/jpeg', '0');
INSERT INTO `qn_posts` VALUES ('1703', '3', '2014-10-28 13:54:32', '2014-10-28 19:54:32', 'Quilting is a popular craft first introduced by the ancient Egyptians. With todays busy lifestyles, it may be difficult for hobbyists to find the time to quilt by hand. A quilting machine enables hobbyists to create beautiful designs in less time. In addition to the various sewing features, the length of the quilting arm is an important consideration when evaluating sewing machine models.\r\n\r\n<h2>The Arm and Throat</h2>\r\n\r\nThe arm is the distance from the middle of the needle to the vertical part of the casing on the right-hand side of the machine. This length determines whether a machine is a short-, mid- or long-arm model. Each length has its advantages and disadvantages. The area under the machines horizontal casing, or arm, and above the base is called the throat or harp. The longer the machine arm, the larger the available work area. Quilting projects will often require the material to be folded or rolled. A larger throat area makes it easier to handle the material before having to reroll, fold or reposition the quilt. It also enables quilters to use thicker batting and larger patterns. The space is usually measured in inches.\r\n\r\n<h2>Short Quilting Arm for Sewing Machine</h2>\r\n\r\nThe throat on a short-arm machine is usually 12 inches or less. A domestic sewing machine with a quilting function may have a throat of only 7 inches. A dedicated short-arm quilting machine will have a throat ranging from 9 to 12 inches. While quilts of any size can be created using these machines, the smaller opening requires the material to be repositioned more often, which makes it harder to work on larger quilts. These smaller machines are typically the least expensive option.\r\n\r\n<h2>Long Quilting Arm for Sewing Machine</h2>\r\n\r\nSince most long-arm machines are mounted on a frame, they have throats 18 inches or longer. The material and batting are fed through the machine from rollers. The quilting machine head moves around the frame while the fabric stays in place. The head can be hand or computer guided. These are usually the most expensive quilting machines.\r\n\r\n<h2>Mid-length Quilting Arm for Sewing Machine</h2>\r\n\r\nMid-arm machines range from 12 to 17 inches. They provide a balance between the other two options. While the throat is not as large as a long-arm model, the mid-arm machine is less expensive. Although it may cost more than a short-arm model, the mid-arm has a large throat area making it easier to work on larger quilts and patterns.', 'Quilting Arm For Sewing Machine', 'Quilting Arm For Sewing Machine - Quilting is a popular craft first introduced by the ancient Egyptians. With todays busy lifestyles, it may be difficult for hobbyists to find the time to quilt by hand. ', 'publish', 'open', 'open', '', 'quilting-arm-for-sewing-machine', '', '', '2014-10-28 13:54:32', '2014-10-28 19:54:32', '', '0', 'http://www.qniquequilter.com/?p=1703', '11', 'post', '', '0');
INSERT INTO `qn_posts` VALUES ('1704', '1', '2014-10-28 13:15:42', '2014-10-28 19:15:42', 'Your sewing machine can help you to create beautiful pieces that you and your loved ones may cherish for years to come. These pieces may include everything from quilts and pillows to clothing and other items. Of course, in order to make full use of the sewing machine that you so carefully selected, you want to invest in quality parts and accessories for it. While there are some additional parts and accessories that may be optional, the fact is that the M class bobbins are a veritable necessity. \r\n\r\n<h2>Why You Need Extra Bobbins</h2>\r\nYour sewing machine likely came with at least one bobbin or even several, but the fact is that you may benefit from having multiple bobbins on hand. The M class bobbin is essential for use with each project that you work on, and it must be wound with the thread color that you are currently using. While you may use black, white and beige threads often, the fact is that you also may use a wide range of other threads for your projects. The last thing you want is to have to unwind your bobbin and potentially waste thread that has not yet been used simply because you need to use a different color of thread on your machine. When you invest in multiple M class bobbins, you can change thread colors without having to clear out the color that is currently on your bobbin. You simply have that bobbin for the next time you plan to use that color of thread. \r\n\r\n<h2>What to Look for When You Purchase New Bobbins</h2>\r\nThere are many types of M class bobbins available for you to purchase. All have the same general design, and you may be able to use these bobbins on machines like the Onique Quilter, the Blockrockit or others with ease. However, you also want to consider the thread capacity of the bobbin as well as the material that it has been made out of. Ideally, high capacity bobbins made from durable materials should be selected. \r\n[br]\r\nBobbins can make your time sitting at the sewing machine more efficient and enjoyable. Some sources recommend that you have at least 10 to 15 M class bobbins on hand for your various needs, but you may even find that you benefit from having more. You can begin by investing in some extra bobbins today, and you can make additional purchases as needed over time.', 'M Class Bobbins', 'M Class Bobbins - While there are some additional parts and accessories that may be optional, the fact is that the M class bobbins are a veritable necessity. ', 'publish', 'open', 'open', '', 'm-class-bobbins', '', '', '2014-10-28 13:15:42', '2014-10-28 19:15:42', '', '0', 'http://www.qniquequilter.com/?p=1704', '12', 'post', '', '0');
INSERT INTO `qn_posts` VALUES ('1705', '1', '2014-10-28 13:15:10', '2014-10-28 19:15:10', 'What to Look for When You Purchase New Bobbins', 'm-class-bobbin', '', 'inherit', 'open', 'open', '', 'm-class-bobbin-4', '', '', '2014-10-28 13:15:24', '2014-10-28 19:15:24', '', '1704', 'http://www.qniquequilter.com/wp-content/uploads/2014/10/m-class-bobbin.jpg', '0', 'attachment', 'image/jpeg', '0');
INSERT INTO `qn_posts` VALUES ('1706', '3', '2014-10-28 14:00:59', '2014-10-28 20:00:59', 'Machine quilters have come a long way over the last few decades. They used to be pretty unreliable machines, and this was especially true of the models that weren\'t created for professional use. In the past, you were often just throwing your money away buying a quilting machine that was designed for home use.<br />\r\n[br]<br />\r\nHowever, that has changed greatly now. There is a new category of quilting machine known as the mid arm sewing machine. This new style of quilting machine has a lot of benefits to offer the home or amateur quilter. These new mid arm quilting machines are much less expensive than the long arm sewing machines. This puts them within the reach of amateur quilters to use at home.<br />\r\n[br]<br />\r\nEven though it will cost less than a long arm model, a mid arm sewing machine offers a comparable quilting ability as a long arm machine. They give home quilters the ability to create professional quality quilts for a fraction of the cost. This has made them very popular with amateur quilters, and they are one of the best-selling categories of quilting machines that are on the market today.<br />\r\n[br]<br />\r\nIf you are an amateur or home quilter, then you may not be aware of how much more quilting you can get done with a good machine. They pace at which you can quilt with a quality machine will surprise you. There are a number of excellent models of mid arm sewing machine that are available today.\r\n[br]\r\nTwo of the best mid arm sewing machines that amateur quilters should consider are the Qnique Quilter and the Block RockiT Quilter. Both of these models will give you the same benefits of a long arm quilting machine, but they are much less expensive. Take a look at them if you are thinking about improving your quilting experience by adding a quilting machine to your sewing room.<br />\r\n[br]<br />\r\nIf you are still doing all of your quilting by hand, then you are not making nearly as many quilts as you should be. You can greatly improve your home quilting process by adding a mid arm sewing machine to your quilting efforts. You will still be able to make beautiful quilts of the highest quality, but you will be able to make many more of them. Adding a mid arm quilting machine to your sewing room will make your quilting experience much more enjoyable.\r\n\r\n\r\n', 'Mid Arm Sewing Machine', ' Mid Arm Sewing Machine - Machine quilters have come a long way over the last few decades. ', 'publish', 'open', 'open', '', 'mid-arm-sewing-machine', '', '', '2014-12-10 17:09:03', '2014-12-11 00:09:03', '', '0', 'http://www.qniquequilter.com/?p=1706', '10', 'post', '', '2');
