INSERT INTO `qn_posts` VALUES ('1906', '3', '2015-01-05 12:52:20', '2015-01-05 19:52:20', '<style>\r\n.video-list{list-style:none;}\r\n.video-thumb{text-align:center; display:inline; float:left; margin:15px; width:150px; height:120px;}\r\n</style>\r\n<h3 style=\"text-align: center;\">Tutorials and How to Videos for the Qnique Quilter Product Line</h3>\r\n<div style=\"margin: auto; max-width: 750px;\">\r\n<ul class=\"video-list\">\r\n<li class=\"video-thumb\"><a href=\"https://www.youtube.com/watch?v=H5NEZ8Md11M\" target=\"_blank\"><img src=\"http://www.qniquequilter.com/wp-content/uploads/2016/06/new-encoder.jpg\" alt=\"Encoders Picture\" width=\"120\" height=\"67\" class=\"alignnone size-full wp-image-3623\" /><br />\r\nInstalling the Encoders</a></li>\r\n<li class=\"video-thumb\"><a href=\"https://www.youtube.com/watch?v=77uzxO8pg3c\" target=\"_blank\"><img src=\"http://www.qniquequilter.com/wp-content/uploads/2015/01/tension.jpg\" alt=\"Tension Picture\" width=\"120\" height=\"67\" class=\"alignnone size-full wp-image-3624\" /><br />Adjusting Sewing Tension</a></li>\r\n<li class=\"video-thumb\"><a href=\"https://www.youtube.com/watch?v=GfVzznrsLtI\" target=\"_blank\"><img src=\"http://www.qniquequilter.com/wp-content/uploads/2015/01/bobbin-winder.jpg\" alt=\"Bobbin Winder Picture\" width=\"120\" height=\"67\" class=\"alignnone size-full wp-image-3625\" /><br />How to use the Bobbin Winder</a></li>\r\n<li class=\"video-thumb\"><a href=\"https://www.youtube.com/watch?v=2DUyxuki3zs\" target=\"_blank\"><img src=\"http://www.qniquequilter.com/wp-content/uploads/2015/01/timing.jpg\" alt=\"Timing Picture\" width=\"120\" height=\"67\" class=\"alignnone size-full wp-image-3626\" /><br />Adjusting the Timing</a></li>\r\n<li class=\"video-thumb\"><a href=\"https://www.youtube.com/watch?v=CrmhStmGDts\" target=\"_blank\"><img src=\"http://www.qniquequilter.com/wp-content/uploads/2015/01/needle.jpg\" alt=\"Needle Picture\" width=\"120\" height=\"67\" class=\"alignnone size-full wp-image-3627\" /><br />Changing the Needle</a></li>\r\n<li class=\"video-thumb\"><a href=\"https://www.youtube.com/watch?v=XooTdumsNj8\" target=\"_blank\"><img src=\"http://www.qniquequilter.com/wp-content/uploads/2015/01/screen.jpg\" alt=\"Screen Picture\" width=\"120\" height=\"67\" class=\"alignnone size-full wp-image-3628\" /><br />Moving the Screen to the Rear Handles</a></li>\r\n<li class=\"video-thumb\"><a href=\"https://www.youtube.com/watch?v=JnqijpdAED0\" target=\"_blank\"><img src=\"http://www.qniquequilter.com/wp-content/uploads/2015/01/oil.jpg\" alt=\"Oil Picture\" width=\"120\" height=\"67\" class=\"alignnone size-full wp-image-3629\" /><br />Oiling the Machine</a></li>\r\n<li class=\"video-thumb\"><a href=\"https://www.youtube.com/watch?v=7FytEaW4lF8\" target=\"_blank\"><img src=\"http://www.qniquequilter.com/wp-content/uploads/2015/01/threading.jpg\" alt=\"Threading Picture\" width=\"120\" height=\"67\" class=\"alignnone size-full wp-image-3630\" /><br />Threading the Qnique</a></li>\r\n<li class=\"video-thumb\"><a href=\"https://www.youtube.com/watch?v=o6nNilDffrg\" target=\"_blank\"><img src=\"http://www.qniquequilter.com/wp-content/uploads/2015/01/sr-2-loading.jpg\" alt=\"SR-2 Frame fabric install video\" width=\"120\" height=\"67\" class=\"alignnone size-full wp-image-3630\" /><br />Loading Fabric on the SR-2 Quilting Frame</a></li>\r\n</ul>\r\n<div style=\"clear: both;\">&nbsp;</div>\r\n</div>\r\n\r\n<div style=\"margin: auto; max-width: 750px; margin-top:25px;  border-top:1px solid #eee; padding:20px; text-align:center;\">\r\n<a href=\"https://www.youtube.com/watch?v=45Bpx3Z7jnw\" target=\"_blank\"><img src=\"http://www.qniquequilter.com/wp-content/uploads/2016/06/encoder-old.jpg\" alt=\"old encoders\"><br />\r\nInstalling the Old Encoders</a>\r\n<p><strong>Note:</strong> This video references the old encoders with the orignal lock collars.<br>If your encoders are different than this, see the new encoder video listed above</p>\r\n</div>\r\n\r\n\r\n\r\n<!--[pvg list=\"howto\"]-->\r\n', 'Tutorials', 'Tutorials and How to Videos for the Qnique Quilter Product Line', 'publish', 'closed', 'closed', '', 'tutorials', '', '', '2016-06-15 13:18:13', '2016-06-15 19:18:13', '', '1909', 'http://www.qniquequilter.com/?page_id=1906', '1', 'page', '', '0');
