INSERT INTO `qn_posts` VALUES ('1915', '4', '2015-01-05 15:12:28', '2015-01-05 22:12:28', '<h3>Computer Automated Quilting</h3><br />\r\n<h3>Powered by QuiltCAD</h3><br />\r\n<p>Enjoy the benefits of a professional automated quilting system in the comfort of your own home! You design it, QuiltMotion quilts it! QuiltMotion takes you seamlessly through pattern design to stitching with absolute ease.</p><br />\r\n<p>&nbsp;</p>\r\n<br />\r\n\r\n<h4 class=\"callush4\" style=\"text-align: center; color: #ff0017;\"></h4><br />\r\n<a href=\" http://www.qniquequilter.com/quiltmotion/ \" class=\"small-action-button\" target=\"_blank\">See Full Details</a>', 'Quilter\'s Creative Touch with QuiltMotion', '<b>Computer Automated Quilting<br /></b>\r\n<i>Powered by QuiltCAD<br /></i>\r\nWith Quiltmotion Software you will enjoy the benefits of a professional automated quilting system in the comfort of your own home! You design it, QuiltMotion quilts it! QuiltMotion takes you seamlessly through pattern design to stitching with absolute ease.<br /><br />', 'inherit', 'open', 'open', '', '1656-autosave-v1', '', '', '2015-01-05 15:12:28', '2015-01-05 22:12:28', '', '1656', 'http://www.qniquequilter.com/1656-autosave-v1/', '0', 'revision', '', '0');
INSERT INTO `qn_posts` VALUES ('1916', '3', '2015-01-06 10:30:47', '2015-01-06 17:30:47', '<p>We absolutly love the Qnique Quilter. So much we have become the main distributor for you to get it in Canada. If you have not tried it yet then do not wait any longer. Go try it now![/rating] For many people, quilting is not just a hobby but a passion as well. Having the ability to create a quilt that will be passed down from generation to generation is something special and today\'s technology is making that easier than ever. The Qnique Quilter, considered to be a revolutionary sewing machine designed especially for quilting, is now available in Canada. Combining many new features and an affordable price, there\'s little doubt the Qnique Quilter in Canada will prove to be very popular.</p>\r\n\r\n<h2>Qnique Features</h2>\r\n<p>Combining what has worked in the past with today\'s modern technology, the Qnique Quilter has many features that are designed to make quilting fun and convenient at the same time. Quilters who use the Qnique Quilter in Canada will notice the machine utilizes many features often found on more sophisticated sewing equipment, including:</p>\r\n<ul>\r\n<li>LED work lights</li>\r\n<li>Multiple accessory ports</li>\r\n<li>Easy-access buttons</li>\r\n<li>Dual thread towers</li></ul>\r\n\r\n<p>In addition to these features, the Qnique Quilter also features a color LED screen that displays various menu options and settings. Very similar to a computer, the machine is made to be very user-friendly for all ages.</p>\r\n\r\n<h2>Why Buy the Qnique Quilter?</h2>\r\n<p>When it comes to quality, the Qnique Quilter has long had a reputation for excellence. Manufactured by the Grace Company, which has over 25 years of experience creating sewing machines for both industrial and personal use, the Qnique was made to be the perfect mid-arm quilting machine. Utilizing numerous features formerly found only on high-end machines, the Grace Company has incorporated these features into the Qnique Quilter to create a machine that\'s both practical and affordable.</p>\r\n\r\n<h2>Customer Satisfaction</h2>\r\n<p>With more than 89 percent of customers giving the Qnique Quilter a rating of \"Amazing,\" it\'s proving to be very popular with those who take their quilting seriously. Some of the reasons that have led to such a high rating include:</p>\r\n<ul><li>Easy to use</li>\r\n<li>Solid construction</li>\r\n<li>Built-in stitch regulation</li>\r\n<li>High stitching speeds</li></ul>\r\n\r\n<p>As the Qnique is used by more and more customers, its popularity seems to grow. Many customers have commented on how easy it is to use the machine\'s joystick-like controls, each of which contains three quick-access buttons for various features. Very popular in many other parts of the world, it seems very likely that with its combination of modern technology and craftsmanship the Qnique Quilter in Canada will be a hit with quilters there as well.<br /><br /> </p>', 'Qnique Quilter In Canada', 'Qnique Quilter In Canada', 'publish', 'closed', 'closed', '', 'qnique-quilter-canada', '', '', '2015-04-22 17:29:18', '2015-04-22 23:29:18', '', '0', 'http://www.qniquequilter.com/?p=1916', '3', 'post', '', '0');
