INSERT INTO `qn_posts` VALUES ('1940', '1', '2015-01-15 10:46:08', '2015-01-15 17:46:08', '', 'Shipping Policy-1940', '', 'inherit', 'open', 'open', '', 'ups-logo', '', '', '2015-06-15 16:42:03', '2015-06-15 22:42:03', '', '1941', 'http://www.qniquequilter.com/wp-content/uploads/2015/01/ups-logo.png', '0', 'attachment', 'image/png', '0');
INSERT INTO `qn_posts` VALUES ('1941', '3', '2015-01-15 11:00:14', '2015-01-15 18:00:14', '<img src=\"http://www.qniquequilter.com/wp-content/uploads/2015/01/ups-logo-168x2001.png\" alt=\"ups\" title=\"UPS Logo\" class=\"alignright\" />\r\n<p>For select items, we offer an Estimated Delivery Date during checkout. An Estimated Delivery Date is a calculation of several factors, including item availability, processing time in our warehouse, the shipping method you select and the shipping destination. When we can accurately calculate Estimated Delivery Dates, we\'ll provide them to you during checkout, as well as in your Order Confirmation email and in the My Account section on the website. Please note that Estimated Delivery Dates are estimates only, and are not guaranteed. Also, if using our Pay in Store payment option, shipping is dependent upon your payment in full at the store. A good rule of thumb is to add 2 additional days if using that option.</p>\r\n\r\n<p>The delivery time for your order depends on the shipping method you select. We offer several different shipping methods. <br /><br /><strong>The choices available depend on...</strong></p>\r\n\r\n<ol>\r\n    <li><strong>The item(s) purchased.</strong></li>\r\n    <li><strong>The in-stock availability of the product.</strong></li>\r\n    <li><strong>The destination address.</strong></li></ol><p>Each shipping method has its own restrictions and charges that will be applied to your order. This is based upon a simple calculation of order processing time and actual shipping time in business days. Please note that business days are Monday through Friday, excluding Federal holidays within the United States.</p>\r\n\r\n<p>Calculating estimated shipping dates is based on several factors, including your destination address and how quickly we can obtain and assemble items for your shipment (the \"usually ships within\" time is listed on a product\'s detail page to help you gauge how quickly we can ship your order out).</p>\r\n\r\n<p>To calculate your delivery estimate, simply take the time called out in the \"Availability\" section on the product detail page (\"Usually leaves warehouse in...\" or what we refer to as \"Processing Time\") and add the time it takes a package to travel from our facilities to your destination address, based on the shipping method you\'ve selected. Please note that orders for multiple items or multiple copies of a single item may take longer to assemble before we\'re able to ship them to you. Also, please don\'t forget to add 2 additional days to the \"Usually leaves warehouse in/Processing time\" timeframe if using our Pay in Store payment option.<br /><br /><strong>How Are Oversized Items Handled?</strong></p>\r\n\r\n\r\n<hr class=\"hd_rule2\" />\r\n\r\n<p>Some heavy or oddly shaped items must be shipped alone using a freight trucking company. <strong><i>Usually, oversized Items arrive in 7-14 full business days after leaving our warehouse</i></strong>. Business days are Monday thru Friday, excluding federal holidays within the United States. Some larger and heavier items can only be sent via ground freight, and it\'s important to note that the freight trucking company is not responsible for unloading the item from the truck, or carrying the item inside. Since the item is likely to be heavy and large, we recommend that you have someone with you to help you unload the item. If you are sending this item as a gift, please include the recipient\'s phone number so the recipient can be contacted in the event the delivery needs to be scheduled.</p>\r\n\r\n\r\n<strong>Are There Any Rules And Restrictions I Should Know About?</strong>\r\n\r\n\r\n<hr class=\"hd_rule2\" />\r\n\r\n<p>Please be aware of the following in order to assist you with your shipping selections and needs:</p>\r\n<ul>\r\n    <li><strong><span style=\"color: #3366ff;\"><em>Orders are shipped on business days only (Monday through Friday) excluding federal holidays within the United States.</em></span></strong></li>\r\n    <li><strong>Your order must be received and your credit card authorized by 12:00 p.m. (noon) EST or your order will not be processed until the following business day. This applies to all shipping methods, including Express Shipping.</strong></li>\r\n    <li>Expedited Shipping and Express Shipping orders require a street address.</li>\r\n    <li>Orders paid for with our Pay in Store payment option will not ship until paid in full at ourstores. You will be provided with 48 hours in which to pay for your order or your order will be automatically cancelled.</li>\r\n    <li>Items shipped to the following destinations may only be shipped via the UPSPostal Service and cannot be expedited:</li>\r\n    <li>Please note that not all items are eligible to ship to APO/FPO/PO Box addresses. Please check individual product detail pages for restrictions.</li>\r\n</ul>\r\n<p>Please allow for additional shipping and handling time for all oversized products shipping via a freight trucking company.<br /><br /></p>\r\n\r\n\r\n<strong>How Do I Track My Order?</strong>\r\n\r\n\r\n<hr class=\"hd_rule2\" />\r\n\r\n<p>Easy! Tracking numbers are assigned to packages at our warehouse almost immediately, and generally appear on our website along with your order information. <strong>It is possible that it may take up to 48 hours or longer before the package is checked into the carrier\'s tracking system</strong>. This basically means that even though your package has left<i>our warehouse</i>, the <i>carrier</i> may not be able to provide any information about your package for up to 48 hours or more.</p>\r\n\r\n<p>To access tracking simply login to the account you created when you purchased the items and look in the tracking section of my account and you will find the information you will need to get the status of your package.</p>\r\n\r\n<p><strong>Orders placed onourwebsites may be delivered by one of several different carriers and shipping methods, therefore, tracking availability may vary depending on:</strong></p>\r\n\r\n<ul>\r\n<li><strong>The type of product you purchased</strong></li>\r\n<li><strong>The \'How to get it\' method you selected during checkout</strong></li>\r\n<li><strong>The carrier that is delivering your product(s).</strong></li>\r\n</ul>\r\n\r\n<p>Occasionally, orders are delivered via a carrier that does not offer the ability to track a package. In these rare instances, \"Order Status / Tracking\" on the website will not offer tracking information, but will still offer order status and other details.</p>\r\n\r\n<p>Store Pickup orders will not be assigned tracking numbers. Order status for Store Pickup orders will be available within 15 minutes in the \"Order Status/Tracking\" area of our website. Order status will also be communicated via the order emails.<br /><br /></p>\r\n\r\n\r\n<strong>How is order status different from tracking information?</strong>\r\n\r\n\r\n<hr class=\"hd_rule2\" />\r\n\r\n<p>Your <strong>Order Status</strong> is supplied byus, and represents what is happening with your order between the time you place it and the time it ships from our warehouse. Once your order leaves our warehouse, it is handled by a carrier (such as FedEx, USPS or UPS) that may provide <strong>Tracking Information</strong> which will allow you to keep track of your order from the time it leaves our warehouse to the time it reaches its destination*. The tracking information is accessible from \"My Accout / Tracking\" on our website when it becomes available.</p>\r\n\r\n<i>*Carrier-provided tracking information may not be available for up to 48 hours after a product is shipped from our warehouse.</i>\r\n\r\n<br /><br />\r\n<strong>What if the estimated delivery date has passed and I still don\'t have my order?</strong>\r\n\r\n\r\n<hr class=\"hd_rule2\" />\r\n\r\n<p>Please note that Estimated Delivery Dates are estimates only, and are not guaranteed. Due to many factors, Estimated Delivery Dates can also change between the time you place the order and receive an order confirmation. We do our best to provide accurate estimates and provide you with several other resources for tracking your order, such as order detail and tracking links. It\'s also important to note that if you selected our Pay in Store payment option, your order will not ship until payment is received in full.</p>\r\n\r\n<p>Orders that are shipped via a trackable method (such as UPS) will have tracking information available in Your Account. <br /><br />Please check this information if available and read through the following options:</p>\r\n<ul>\r\n    <li>If the tracking information indicates the package has been delivered, please check with your neighbors or family members. Packages are occasionally left with neighbors, a building manager, or are placed somewhere relatively safe such as your porch, garage, or even behind bushes.</li>\r\n    <li>If the tracking information indicates the package is being returned to us, or if the address is incorrect, it may have been undeliverable.</li>\r\n</ul>\r\n<p>If there is no tracking information, or you cannot locate the package and it is not being returned as undeliverable, please feel free to contact an online customer service specialist for assistance at <span style=\"color: #3366ff;\">support@qniquequilter.com</span></p>', 'Shipping Policy', '', 'publish', 'open', 'open', '', 'shipping-policy', '', '', '2015-10-02 12:53:19', '2015-10-02 18:53:19', '', '2905', 'http://www.qniquequilter.com/?page_id=1941', '6', 'page', '', '0');
