INSERT INTO `qn_posts` VALUES ('1943', '3', '2015-01-15 18:59:30', '2015-01-16 01:59:30', '<h2>Externmal Links Policy</h2><p>http://www.qniquequilter.com links to other, external web sites that provide information we determine at our discretion contain the most useful information for our program. While many sites provide very useful information, http://www.qniquequilter.com only links to those sites which provide the most useful content.</p><p>These links may be changed at any time as more useful sites come to our attention. The sole purpose of any external link is to enrich this site for our customers. All requests for inclusion of a link on this site is first and primarily evaluated with the needs of our customers in mind. Generally, external web sites do not meet the purposes of http://www.qniquequilter.com if they contain, suggest, or infer any of the following:</p><ol><li>Advocacy of or opposition to any politically, environmentally, or socially controversial subjects, issues, or candidates.</li><li>Disparaging or promoting any person or class of persons.</li><li>External content not suitable for readers or viewers of all ages, or links to or other promotion of businesses whose products or services are not suitable for persons of all ages.</li><li>Promoting or inciting illegal, violent, or socially undesirable conduct.</li><li>Promotion or availability of alcohol or tobacco products.</li><li>Promotion or availability of illegal drugs.</li><li>Promotion or availability of adult or sexually oriented entertainment or materials.</li><li>Promotion, opposition, or availability of weapons.</li><li>Promotion, opposition, or availability of gambling.</li><li>Claims of efficacy, suitability, desirability, or other non-objective statements about businesses, products, or services.</li><li>Content that infringes on any trademark, copyright, or patent rights of another.</li><li>Claims or representations in violation of advertising or consumer protection laws.</li><li>Content that a reasonable citizen may not consider to maintain the dignity and decorum appropriate for government.</li></ol><p>This list is a nonexclusive list. The external link policy applies only to web sites outside http://www.qniquequilter.com The webmaster shall establish procedures to monitor the implementation and continuing oversight of this policy. These procedures shall include a process for review of all new requests for external content links from http://www.qniquequilter.com Web page to another page to ensure compliance with this policy prior to granting the request.</p><p>Each request for such a link shall be evaluated using the following guidelines:</p><b>Is the content relevant?</b><br /><p>Does the site provide information or services, which are not already available or linked to on http://www.qniquequilter.com? If not, is the quality of the site comparable to or better than what is already provided?</p><b>Is the site well designed, easy to use, cross-browser compliant, and accessible to people with disabilities?</b><p>http://www.qniquequilter.com reserves the right, at its sole discretion and without explanation, to withdraw at any time any external content for any reason.</p>', 'External Links Policy', '', 'publish', 'open', 'open', '', 'external-links-policy', '', '', '2015-04-23 13:00:57', '2015-04-23 19:00:57', '', '2905', 'http://www.qniquequilter.com/external-links-policy/', '2', 'page', '', '0');
INSERT INTO `qn_posts` VALUES ('1946', '1', '2015-01-17 14:58:25', '2015-01-17 21:58:25', '<h2>Serious Quilters Require Specialized Sewing Machines</h2>\r\n\r\n<p>Anyone interested in making quilts or other layered fabric projects such as decorative wall hangings needs the best equipment available. People who love to sew can find the Grace Qnique Machine for sale online or at The Grace Company in Utah. Quilters are serious about the machines they use, leading to looking for particular features that make stitching multiple layers of fabric together simpler. For over 25 years, The Grace Company headquartered in Salt Lake City has specialized in designing, manufacturing and selling the highest quality equipment necessary for individuals who love quilting. Instead of dealing with bulky materials on traditional sewing machines that have a small arm work area, buy the Grace Qnique Machine. </p>\r\n\r\n<h2>A Quilting Machine with Numerous Features is Necessary</h2>\r\n\r\n<p>Many quilters today want to make bedcovers for larger mattress sizes such as queen or king, leading to needing bigger quilt squares. Stitching on larger squares of fabric is easier with a mid-arm machine with a bigger working space to maneuver the material quickly. Instead of needing to stop and start the sewing machine often to rearrange fabric, the seamstress can rotate the squares while stitching. Not only is this maneuverability a great feature while making individual squares, it is also helpful when stitching on borders, fillings and backings of quilts. The engineers who designed the Grace Qnique Machine have thought of everything, including:</p>\r\n[br]\r\n<ul>\r\n<li>An easy to read full color LED menu screen</li> \r\n<li>Built-in stitch regulation (precise, cruise, baste, manual)</li> \r\n<li>Four different sewing modes</li> \r\n<li>Hopping foot components</li> \r\n<li>15-inch machine throat length</li> \r\n<li>Six simple to use fingertip controls</li> \r\n<li>Fast top stitching speed</li> \r\n<li>Sturdy internal construction and mechanics</li> \r\n<li>Heavy-duty metal body</li> \r\n<li>Holders for large spools of thread</li> \r\n<li>Unique wheels to move the machine</li> \r\n<li>Beautiful crisp white finish</li> \r\n<li>Easy dual threading and bobbin filling</li> \r\n<li>Lightweight aluminum body for easy moving</li> \r\n<li>Small enough to store easily</li> \r\n<li>Interchangeable between left- and right-handed</li> \r\n<li>Additional accessory power ports</li> \r\n<li>Dual voltage power supply</li> \r\n<li>Easy to change software with no technician required</li> </ul>\r\n[br]\r\n\r\n<h2>What Owners Think about this Quilting Machine</h2>\r\n\r\n<p>This Grace Qnique Machine is shipped with several important accessories such as lubricating oil, quilting needles and bobbins that assist with making gorgeous quilts. Quilters are a cohesive group of enthusiasts who highly recommend this machine with an overall 89 percent rating. Owners of this quilting machine believe it has a high stitching accuracy, solid construction and is easy to use. Compared to other specialized quilting sewing machine, this one is much more affordable. For anyone struggling to make quilts on a traditional sewing machine, switching to a specialized machine is a life changer. Customers can request expedited shipping on the Grace Qnique Machine to begin sewing as fast as possible with a new machine.</p>', 'Grace Qnique Machine', 'This Grace Qnique Machine is shipped with several important accessories such as lubricating oil, quilting needles and bobbins that assist with making gorgeous quilts. Quilters are a cohesive group of enthusiasts who highly recommend this machine with an overall 89 percent rating.', 'publish', 'closed', 'open', '', 'grace-qnique-machine', '', '', '2015-01-17 14:59:15', '2015-01-17 21:59:15', '', '0', 'http://www.qniquequilter.com/?p=1946', '2', 'post', '', '0');
