INSERT INTO `qn_posts` VALUES ('1964', '1', '2015-02-04 10:23:19', '2015-02-04 17:23:19', '', 'Grace Qnique Quilting Machines', '', 'draft', 'closed', 'closed', '', 'grace-qnique-quilting-machines', '', '', '2015-04-23 13:01:58', '2015-04-23 19:01:58', '', '1969', 'http://www.qniquequilter.com/?page_id=1964', '5', 'page', '', '0');
INSERT INTO `qn_posts` VALUES ('1965', '7', '2015-02-03 12:02:53', '2015-02-03 19:02:53', '<h3 itemprop=\"hasPart about\">Grace Company Machine Quilting Frames Feature Proven Methods for Creating Lovely Quilts</h3>\r\n\r\n<p>When it comes to high-quality machine quilting frames, there is an impressive selection featured online at top quilters websites. In fact, the use of quilting frames is linked to the process of quilters needing to rotate their creations. The fames or stands allow quilters to tilt, rotate and to simply have this tool to enjoy quilting in various comfortable positions. Online testimonials from longtime quilters point to the best machine quilting frames are produced by the Grace Company frame manufacturer.</p>\r\n\r\n<p>Another aspect of having the best quilting frame is linked to stands that quilters say can be easily adjusted for working on a creation without worry during the quilting process. For instance, a quilter commented online about how her Grace Company frame easily adjusts for both right and left hand use. A good frame is vital for such things as better stitch control.</p>\r\n\r\n<h3 itemprop=\"hasPart about\">Grace Company quilting frames</h3>\r\n\r\n<p>The popular Grace Company motto, We provide the tools, you create the masterpiece rings true for quilters when commenting online about user friendly machine quilting frames. For example, todays clever quilter needs all sorts of frames to help them create projects that require a good foundation and tools to get the job done. Grace frames are credited with having all the bells and whistles to compliment the hand or machine sewing process. For instance, Grace quilting frames feature easy to adjust rails for both needed height and adjustments.</p>\r\n\r\n<p>At the same time, the Grace Company Fabri-Fast frame quilting system is featured in all of the companys rails. The manufacturer notes that its machine quilting frames allow the quilter to have more freedom during the creation of quilts.</p>\r\n\r\n<ul> \r\n <strong>The features include:</strong> \r\n    <li>Quilting system that frees one from needing the usual quilting ties, tape or tacks.</li>\r\n    <li>A true user friendly system for sliding fabric into the quilting machine rail slot to secure it without worry.</li>\r\n    <li>Frames that are credited with having a fluid and really smooth feel when working on a creation.</li>\r\n    <li>Frames made with solid metal construction and really smooth gliding on its quality and proven plastic track that never lets a quilter down.</li>\r\n    <li>Frames designed for accurate movement and perfect for precise work with tools for intricate stitching on small or large stitching surfaces.</li>\r\n    <li>Various clamps and slots that allow for all types of quilting work styles via the manufacturers many additional quilting notions or accessories that make this process really fun and enjoyable.</li>\r\n</ul>\r\n\r\n<p>In general, The Grace Company is the gold standard for creating high quality machine quilting frames that are priced reasonably and backed up with great product support, warranties and customer service.</p>\r\n\r\n<h3 itemprop=\"hasPart about\">Quilting frame reviews and accessories</h3>\r\n\r\n<p>There is an almost endless listing of positive and truly complimentary comments online from Grace Company customers singing the praises of its machine quality frames. The Gracie King and Gracie King are two examples of highly popular Grace Company machine quilting frames that are specifically designed with the creative and skilled quilter in mind. In fact, the quilting frames on offer today are not only considered to be attractive looking but also lovely to look at in anyones work room. For example, the companys fine wood crafted machine quilting frame is dubbed The Gracie King because it is truly the king of modern quilting frames today.</p>\r\n\r\n<h3 itemprop=\"hasPart about\">Quilting frame for machine &amp; hand quilters</h3>\r\n\r\n<p>At a time when many quilters are looking for a high quality quilting frame for either machine process or to help hand quilters with their creations, Grace Company frames meet the need with high customer ratings. For instance, a longtime quilter explained online that without a good machine quilting frame that features such things as height adjustable rails or legs, ones job is much more difficult. The quilter said she needed fame for hand quilting that is easy to examine when working on various layers of her quilt creation.</p>\r\n\r\n<p>Meanwhile, Grace Company features a no-baste, no-fuss system that includes aluminum rails featuring precision ratchets that translates to a quilter being able to use the best machine tools to get just the right amount of tension. In turn, hand quilters say they appreciate such things as easy fabric attachments, the unique Grace Company flip-up rail and other adjustable features that make quality with this frame very successful.</p>\r\n\r\n<h3 itemprop=\"hasPart about\">Quilting made easy with Grace Company</h3>\r\n\r\n<p>The machine quilting frames on offer from Grace Company are not only fun to use, but are considered to be very nice to look at as well. For example, both the Gracie King and Gracie Queen models include special rails for batting, stunningly lovely looking wood craft construction that says high quality. In addition, there is no worries about being able to move around a quilt creation because these high quality machine frames feature adjustable legs, leveling fee, strong rails for big quilts and specialized bungee clamps to keep ones creation properly secured for detailed quilting.</p>\r\n\r\n<h3 itemprop=\"hasPart about\">Frame quilting at home made easy</h3>\r\n\r\n<p>Machine quilting frames are not made alike. There are the gold standard Grace Company models, and there is everything else. However, one sets Grace Company apart is a true quality customer service support system that compliments the companys top of the line quilting frames that are priced for every budget. The companys online catalog and website offerings are impressive when it comes to a keen knowledge and understanding of what todays modern quilters really need when talking true machine quilting frames that never let you down.</p>\r\n\r\n<p>For instance, the companys trending SR2 machine quilting frame offers any quilter a great looking and working machine at an affordable price.</p>\r\n\r\n<p>Overall, the modern quilter needs a machine quilting frame that compliments his or her unique quilting style and process. The Grace Company \"gets\" this fact, and is credited with designing its machine frames with the quilter in mind. The result is a family of Grace quilters who share their appreciation of these top of the line machine quilting frames with friends and family. The beautiful quilts produced with the aid of Grace Company machine quilting frames is the result.</p>\r\n', 'Machine Quilting Frames', 'Grace Machine Quilting Frames are known for their smooth-gliding carriage and track system. The Professional Series Carriage ensures precise and accurate movement, perfect for small, intricate stitching.  All Grace machine quilting frames use a no-baste rail system. Each rail on the machine quilting frames has the innovative Fabri-Fast slot, making fabric attachment easy without the need for quilt tacks, tape or ties.', 'publish', 'closed', 'open', '', 'machine-quilting-frames', '', '', '2015-04-23 13:01:58', '2015-04-23 19:01:58', '', '1969', 'http://www.qniquequilter.com/?page_id=1965', '2', 'page', '', '0');
INSERT INTO `qn_posts` VALUES ('1969', '3', '2015-02-03 12:12:59', '2015-02-03 19:12:59', '', 'Informational Materials', 'Qnique Quilter informational section full of resources we think you might have an interest in. ', 'publish', 'closed', 'closed', '', 'information', '', '', '2015-05-28 17:42:06', '2015-05-28 23:42:06', '', '0', 'http://www.qniquequilter.com/?page_id=1969', '12', 'page', '', '0');
INSERT INTO `qn_posts` VALUES ('1971', '7', '2015-03-23 15:13:59', '2015-03-23 21:13:59', '<h2 itemprop=\"hasPart about\">Machines Must Stitch Through Multiple Layers</h2>\r\n\r\n<p>Anyone making quilts needs the appropriate supplies to make the task easier. Quilting machines are designed by experts who understand the special requirements for a device meant to stitch through multiple layers of fabric. Traditional sewing machines are difficult to use while making quilts, especially devices in larger sizes that are now required for many bed mattresses. This has led to manufacturers making long arm quilting machines instead that are often several feet long to hold material securely while stitching. With a long arm device, the cloth does not need folding or bunching as the sewer stitches the fabric. </p>\r\n\r\n<h2 itemprop=\"hasPart about\">Choose a Machine with Modern Features</h2>\r\n\r\n<p>Because many individuals or companies use quilting machines to make items to sell to customers, the ability to stitch material faster increases profits. Quilters no longer must refold or shift fabric and batting to create decorative stitching on coverlets and bed covers. It is possible to buy specialized machines for quilting for home use from brick-and-mortar and online stores. With modern technology, most sewing machines are equipped with state-of-the-art and easy to use features such as:</p>\r\n<ul>\r\n<li>LCD touch pad screens</li>\r\n<li>Automated stitch regulators</li>\r\n<li>Large workspaces</li>\r\n<li>Well lit work areas</li>\r\n<li>Simple to use bobbin winders</li>\r\n<li>Easy to access thread spoolers</li>\r\n<li>Multiple position handles</li>\r\n<li>Interchangeable hopping foot</li>\r\n<li>Automatic needle positioning</li>\r\n<li>Laser stylus</li>\r\n</ul>\r\n\r\n<h2 itemprop=\"hasPart about\">Sewing is Easier with a Quilt Sewing Machine</h2>\r\n\r\n<p>For someone who has never used the newest models of quilting machines, the ease of sewing with one is a pleasant surprise. Instead of struggling to stitch through multiple layers of fabric along with batting, a specialized machine with a free arm offers a way to adjust the materials without making any errors. Quilters can choose machine models that are portable or ones that are permanently attached to tables or stands. With a specialized stand or table, it is possible to stretch out the entire quilt rather than work on one small section at a time. In addition, it is possible to move the entire machine to work on different areas of the quilt. </p>\r\n\r\n<h2 itemprop=\"hasPart about\">Manufacturers make it Easy to Select a Machine</h2>\r\n\r\n<p>Quilting machines are available in a variety of price points that are affordable for each person. To make shopping simple, quilters can see full color photographs and informative videos to understand how a machine works before making an ordering decision. The features are listed next to the product along with information about its value for a commercial or home quilter. Manufacturers may offer an assortment of accessories that are included such as extra bobbins, needles or lubricating oil. Alternatively, there are often accessories that are sold separately.</p>', 'Quilting Machines', 'Quilting machines are designed by experts who understand the special requirements for a device meant to stitch through multiple layers of fabric. ', 'publish', 'open', 'open', '', 'quilting-machines', '', '', '2015-04-23 13:01:58', '2015-04-23 19:01:58', '', '1969', 'http://www.qniquequilter.com/?page_id=1971', '1', 'page', '', '0');
