INSERT INTO `qn_posts` VALUES ('1979', '6', '2015-02-04 11:36:10', '2015-02-04 18:36:10', '<p>Thank you for your question and interest. We will be attending the International Quilt Festival in Chicago this March. We will have the Qnique machine set up with computer automated system.</p><p>We dont do trade ins.</p><p>I hope this show is a show that you can attend, we will have a great deal for our machine and frame combos or even just the machine.</p><p>If you should have any other questions please dont hesitate to ask.</p><p>Kind Regards,<br />Mark</p>', 'I am interested in this machine and have attended quilting expos. Will this machine be at any quilt expos in 2015?', '', 'publish', 'closed', 'closed', '', '1979', '', '', '2015-05-28 13:34:46', '2015-05-28 19:34:46', '', '0', 'http://www.qniquequilter.com/?post_type=smart_faq&#038;p=1979', '0', 'smart_faq', '', '0');
