INSERT INTO `qn_posts` VALUES ('2021', '1', '2015-02-26 17:04:47', '2015-02-27 00:04:47', 'QuiltMotions quilt design software comes with a library of over 200 patterns to choose from. You can always import new digital patterns from other sources, or use the pattern design software to create your own!', '', '', 'publish', 'open', 'closed', '', '2021', '', '', '2015-10-22 09:52:43', '2015-10-22 15:52:43', '', '341', 'http://www.qniquequilter.com/?p=2021', '36', 'nav_menu_item', '', '0');
INSERT INTO `qn_posts` VALUES ('2023', '0', '2015-02-28 09:55:37', '2015-02-28 16:55:37', 'I am interested in possibly purchasing a quilting machine but have never learned how to quilt with a long arm. When you quilt with this machine: 1. is there a place I can go to take lessons on in my area? 2. Do you have to free motion this by moving it yourself? or is it done by computer patterns that you just steady the machine? \r\n', 'Kellee Strunk', '', 'publish', 'open', 'open', '', 'kellee-strunk', '', '', '2015-02-28 09:55:37', '2015-02-28 16:55:37', '', '0', 'http://www.qniquequilter.com/?cx_offline_msg=kellee-strunk', '0', 'scx_offline_msg', '', '0');
