INSERT INTO `qn_posts` VALUES ('2812', '1', '2015-03-04 14:25:51', '2015-03-04 21:25:51', '	<h2>1) Enter the Pattern Observer Textile Design Contest.</h2>\r\n	Pattern Observer has partnered with P&amp;B Textiles to host our first annual Textile Design Competition! Due to regulations regarding setting up contests online, this competition is open only to US residents. The winner will receive a licensing contract with P&amp;B Textiles and a one-year membership to Pattern Observer\'s Textile Design Lab. We will also be awarding ten Semi-Finalist Winners a one-year membership to The Textile Design Lab and additional runner-up prizes from our sponsors. Collections must be received by March 1, 2015.\r\n	How to enter:\r\n	<ul>\r\n	    <li>You can read the rules and design guidelines on the competition website.</li>\r\n	    <li>Create a textile design collection, consisting of a main pattern and a coordinating pattern, based upon one of the supplied creative briefs.</li>\r\n	    <li>Designers who are unfamiliar with main and coordinating patterns are welcome to listen to Pattern Observer\'s free webinar explaining the collection development process.</li>\r\n	</ul>\r\n	<h2>2) Gain exposure by joining our newest Instagram Challenge</h2>\r\n	Ever dream of getting recognized by an art director or buyer in the textile design industry? Social media is an excellent way to get recognized and even build those relationships. If you would like to make connections with fellow artists and experts in the industry, join our newest challenge all about creating quilting collections. (Be sure to check out the creative briefs for the quilting industryyou can download them here.)\r\n	This is a fun challenge and not a contestit offers a great opportunity for you to build your brand and gain exposure in the industry.\r\n	Here are a few ways you can join the fun on Instagram:\r\n	<ul>\r\n	    <li>Share a behind the scenes snapshot of your design process in this industry.</li>\r\n	    <li>Share a snapshot of your quilting textile designs or collections.</li>\r\n	    <li>Include the challenge hashtags in the caption: #PatternObserverChallenge #PatternObserverQuilting.</li>\r\n	    <li>Build community by commenting on other posts in the challenge.</li>\r\n	    <li>Stay positive. Keep your social media posts related to the challenge upbeat. Negative posts can turn followersand industry leadersoff.</li>\r\n	</ul>\r\n	This Instagram Challenge runs from February 23rd to March 30th. Pattern Observer will be checking in daily we can\'t wait to see what you create. We will share our favorite posts here during the challenge. <br />\r\n\r\n	<div id=\"DIV_1\">\r\n	<div id=\"DIV_5\">\r\n			<span id=\"SPAN_6\">FULL ARTICLE</span> <a rel=\"index nofollow\" href=\"http://www.quiltingindustry.com/info/five-ways-get-recognized-quilting-industry/\" id=\"A_7\" title=\"five ways get recognized quilting industry\" target=\"_blank\">quiltingindustry.com</a>\r\n		</div>\r\n		<div id=\"DIV_2\">\r\n			<span id=\"SPAN_3\">VIA</span> <a rel=\"index nofollow\" href=\"http://patternobserver.com/author/michelle/\" id=\"A_4\" target=\"_blank\">Michelle</a>\r\n		</div>\r\n		<div id=\"DIV_5\">\r\n			<span id=\"SPAN_6\">SOURCE</span> <a rel=\"index nofollow\" href=\"http://patternobserver.com/2015/02/23/build-brand-five-ways-get-recognized-quilting-industry\" id=\"A_7\" target=\"_blank\">PatternObserver.com</a>\r\n		</div>\r\n	</div>', 'Get Recognized in the Quilting Industry', 'Get Recognized in the Quilting Industry by entering the Pattern Observer Textile Design Contest.', 'publish', 'open', 'open', '', 'get-recognized-in-the-quilting-industry', '', '\nhttp://www.quiltingindustry.com/info/five-ways-get-recognized-quilting-industry/', '2015-03-04 14:25:51', '2015-03-04 21:25:51', '', '0', 'http://www.qniquequilter.com/?p=2812', '0', 'post', '', '0');
