INSERT INTO `qn_posts` VALUES ('2837', '0', '2015-03-14 20:56:09', '2015-03-15 02:56:09', 'Hello,\r\nI set up my new Q\'nique 14+.  The laser light is plugged into the back of the Display Hub, but does not turn on when the button is pressed.  The machine is plugged in and turned on.  I don\'t think the encoders are working.  The stitches are not being regulated when in Cruise or Precise.  The \"over speed\" beep works too well!  I must be going too fast.  What happens if I turn off the blasted beep?  :)  \r\nWhen I used the Encoder Test in Diagnostics, both left and right encoders show a red dot.  \r\n\r\nCan you help me to get my beautiful new machine up and running?\r\n\r\nPS  There was only one encoder lock collar in the box.  Quality Sewing and Vacuum gave me one from their machine.  They also gave me their plastic cord for inserting the material into the take up bar.  (Thought you might want to know for quality control.) Otherwise all other parts arrived.  The instructions were clear and easy to follow!', 'Trudy Hoy', '', 'publish', 'open', 'open', '', 'trudy-hoy', '', '', '2015-03-14 20:56:09', '2015-03-15 02:56:09', '', '0', 'http://www.qniquequilter.com/?cx_offline_msg=trudy-hoy', '0', 'scx_offline_msg', '', '0');
