INSERT INTO `qn_posts` VALUES ('2847', '0', '2015-03-20 18:13:40', '2015-03-21 00:13:40', 'I am having issues with my new qnique.  The LCD screen is not working properly.  If we can get it on, the screen is completely gray - unreadable.  We have unplugged, plugged, switched an ends and it is still unreadable.  We are also having issues with the hopper foot not working correctly.  It is banging against the top of the needle and it does not always go up or down.  Please call after 4:00 pm.  Thanks!  Jan Murray, De Soto, KS', 'Jan Murray', '', 'publish', 'open', 'open', '', 'jan-murray', '', '', '2015-03-20 18:13:40', '2015-03-21 00:13:40', '', '0', 'http://www.qniquequilter.com/?cx_offline_msg=jan-murray', '0', 'scx_offline_msg', '', '0');
