INSERT INTO `qn_posts` VALUES ('2850', '7', '2015-03-23 11:10:00', '2015-03-23 17:10:00', '<p>There\'s nothing that can compare to the fine art of quilting. As a tradition that has been passed down for generations, many a home has a collection of treasured quilts. Some are tucked away. Some are used. Others are lovingly passed on. Quilts hang on walls and are on display in museums and exhibits. They tell a story and great devotion is contained within every square. If you make magic with quilting and want to make your life easier, turn to a quilting machine manufacturer who knows quilting. With a unique quilting machine from the Grace Company, you will be able to make more dreams become reality with every completed quilt.</p>\r\n\r\n<h2  itemprop=\"hasPart about\">It\'s All about Helping You to Produce Works of Beauty</h2>\r\n<p>With a first rate quilting machine produced by the Grace Company, you won\'t believe what a difference it can make in your quilting projects. As a quilting machine manufacturer that specializes in all leading brands of quilting machines, there is sure to be a machine that is the right fit for you. When you combine a quilting machine with a frame, you\'ll find that it is much easier to produce beautiful quilts that will become part of your heritage. You\'ll be able to piece your quilts with ease as the machine sews your layers together. You can count on the expertise of a quilting machine manufacturer to understand the process of quilting inside and out. Let the Grace Company help you to indulge yourself even more in your favorite hobby. If quilting is a part of your livelihood, you really need to find out how a quilting machine can change your life.</p>\r\n\r\n<h2  itemprop=\"hasPart about\">Create a Legacy that is built to Last</h2>\r\n<p>When you design a quilt and see it through to completion, you are leaving a piece of yourself that will be passed on to the future. Whether you are creating quilts simply for the pure joy of it, you give them as gifts, or you sell them in a shop, your quilts capture your imagination. Each one tells a story and it all begins with you. Discover how the Grace Company can help you on the journey to becoming a dream maker. Learn more about quilting machines and find the machine that is the right fit for you. You owe it to yourself to find out how you can bring more quilts to the world.</p>', 'Quilting Machine Manufacturer', 'Quilting Machine Manufacturer.  If you make magic with quilting and want to make your life easier, turn to a quilting machine manufacturer who knows quilting.', 'publish', 'open', 'closed', '', 'quilting-machine-manufacturer', '', '', '2015-03-23 14:13:40', '2015-03-23 20:13:40', '', '0', 'http://www.qniquequilter.com/?p=2850', '0', 'post', '', '0');
INSERT INTO `qn_posts` VALUES ('2851', '1', '2015-03-23 11:07:55', '2015-03-23 17:07:55', '', 'The-Grace-Conpany-Manufacturer-Banner', '', 'inherit', 'open', 'open', '', 'the-grace-conpany-manufacturer-banner', '', '', '2015-03-23 11:08:20', '2015-03-23 17:08:20', '', '2850', 'http://www.qniquequilter.com/wp-content/uploads/2015/03/The-Grace-Conpany-Manufacturer-Banner.jpg', '0', 'attachment', 'image/jpeg', '0');
INSERT INTO `qn_posts` VALUES ('2852', '7', '2015-03-23 11:56:14', '2015-03-23 17:56:14', '<h2 itemprop=\"hasPart about\">The Importance of Having Specialized Equipment for Sewing Quilts</h2>\r\n\r\n<p>A machine quilting frame is an essential piece of equipment for hobbyists or commercial sewers making patchwork, pieced or embroidery embellished quilts designed as coverlets for beds. Large sections of cotton or wool fabrics are difficult to maneuver on traditional sewing machines with small work areas. Fortunately, manufacturers have worked with knowledgeable quilters to develop a machine quilting frame that is commonly known as a long arm that allows stretching fabrics with clasps along the devices to hold it firmly in place. Anyone stitching the layers of a quilt together or creating embroidery stitches needs the ability of seeing the entire item with this specialized device. </p>\r\n\r\n<h3 itemprop=\"hasPart about\">Vital Features to Look for When Buying Quilt Frames for Home or Commercial Use</h3>\r\n\r\n<p>At the same time, the machine quilting frame must hold the fabric tautly to permit accurate stitching to create the most beautiful design without errors. A manufacturer of devices meant for making quilts must also have several models to choose from in different price points to meet the needs of commercial or home sewers. Some of the features that shoppers look for when buying a machine quilting frame are: </p>\r\n<ul>\r\n<li>Sturdy rolling bars  to hold fabrics in place in different sections</li>\r\n<li>Surface is appropriate size  to hold a sewing machine</li>\r\n<li>Smooth carriage system  to provide great stitching</li>\r\n<li>Having several rails or rollers  enough to hold fabric off the floor</li>\r\n<li>Type of material  traditional wood, heavy steel or lightweight aluminum</li>\r\n<li>Adjustable height  height adjusts with legs for sitting or standing work</li>\r\n<li>Storage capabilities  foldable for storage in small homes or businesses</li>\r\n<li>Adjustable frame  for working on crib quilts to king-size items</li>\r\n<li>Accessories  accessories available for specialized projects</li>\r\n<li>Warranty  company provides warranty for repairs or replacement</li>\r\n</ul>\r\n\r\n<h2 itemprop=\"hasPart about\">How to Find Well Made Quilt Frames at an Online Store </h2>\r\n\r\n<p>In addition to the above features, many quilters want the ability to baste several fabrics together before placing the layers of materials on a machine quilting frame while others want to stitch without this step. The ability to place the quilt quickly in the frame makes it possible to begin sewing items right away, leading to saving time for everyone and increasing profits for commercial sewers. All of the mechanisms on the machines require testing by manufacturers to ensure the components do not harm fabrics by making holes or discolorations. In addition, the machines should have safety covers in place over moving components to avoid injuries to the hands or fingers. A good way for quilters to find quality frames for sewing is to look at an online retailer that provides full color photographs and detailed descriptions of products.</p>', 'Machine Quilting Frame', 'A machine quilting frame is an essential piece of equipment for hobbyists or commercial sewers making patchwork, pieced or embroidery embellished quilts designed as coverlets for beds. Large sections of cotton or wool fabrics are difficult to maneuver on traditional sewing machines with small work areas. ', 'publish', 'open', 'closed', '', 'machine-quilting-frame', '', '', '2015-03-23 12:32:02', '2015-03-23 18:32:02', '', '0', 'http://www.qniquequilter.com/?p=2852', '0', 'post', '', '0');
INSERT INTO `qn_posts` VALUES ('2853', '1', '2015-03-23 11:55:50', '2015-03-23 17:55:50', 'Machine Quilting Frame Banner', 'Machine Quilting Frame Banner', '', 'inherit', 'open', 'open', '', 'machine-quilting-frame-banner', '', '', '2015-03-23 11:55:50', '2015-03-23 17:55:50', '', '2852', 'http://www.qniquequilter.com/wp-content/uploads/2015/03/machine-quilting-frame-banner.jpg', '0', 'attachment', 'image/jpeg', '0');
INSERT INTO `qn_posts` VALUES ('2854', '7', '2015-03-23 13:45:54', '2015-03-23 19:45:54', '<p>For many companies, innovation and invention are the foundation on which success is built. This has been a key component in the quilting industry, which has seen a dramatic transformation due to technology that has made the process of quilting easier for those who possess a passion for the craft. Over the past 25 years, <a href=\"http://www.graceframe.com\" title=\"The Grace Company\" target=\"_blank\" rel=\"nofollow index\">The Grace Company</a> has taken innovation and invention to entirely new levels with its commitment to integrating the worlds of quilting and technology. The results have been products that have not only revolutionized the industry, but also given those with a love of quilting the ability to create masterpieces almost beyond belief. With their commitment to customer service and always being willing to take a concept and develop it into yet another product to satisfy their customers, The Grace Company has started a tradition of excellence that has no end in sight.</p>\r\n\r\n<h2 itemprop=\"hasPart about\">Quilting Frames</h2>\r\n<p>To create any quilt, a quilting frame is required to make the task possible. The Grace Company, having developed a line of quilting frames unlike any previously seen, quickly became the go-to company for those needing the best possible equipment. With both machine-quilting and hand-quilting frames from which to choose, customers soon found themselves with a variety of possibilities when it came to quilting. The frames offered numerous advantages to customers, including:</p>\r\n<ul>\r\n<li>Professional-quality rail system</li>\r\n<li>Improved fabric tension</li>\r\n<li>Height adjustment to fit sewing machines</li>\r\n<li>Speed control and stitch regulators</li>\r\n</ul>\r\n\r\n<strong>With the introduction of these features, Grace quickly became the company associated with quilting quality and began its ascension to the top. </strong>\r\n\r\n<h2 itemprop=\"hasPart about\">Quilting Machines</h2>\r\n\r\n<p>Grace company has now developed 2 models of quilting machines you might have heard of or possibly used at one of the recent quilting shows around the Unites States in late 2014 or up to now. These two machines are:</p>\r\n<ul>\r\n<li><a href=\"http://www.qniquequilter.com/\" title=\"Qnique Quilter\" rel=\"follow index\">Qnique Quilter</a></li>\r\n<li>Block Rockit</li>\r\n</ul>\r\n\r\n<h2 itemprop=\"hasPart about\">Computerized Quilting Technology</h2>\r\n<p>However, what truly set The Grace Company apart from other competitors was its embracing of computerized technology when it came to quilting. With its development of quilting pattern software, the company made it possible to see how a design would look before the first stitch was sewed. In doing so, quilts could contain designs that were more intricate than ever before, and as a bonus would take far less time and effort than in previous years. Some of the most popular quilting software programs have included:</p>\r\n<ul>\r\n<li><a href=\"http://www.qniquequilter.com/product/quiltmotion/\" title=\"Quilters Creative Touch with QuiltMotion\" target=\"_blank\" rel=\"follow index\">QuiltMotion</a></li>\r\n<li>Quilter\'s Creative Touch</li>\r\n<li>Quilter\'s Creative Design</li>\r\n</ul>\r\n\r\n<p>The grace company has created the computerized technology of many of your big quilting machine manufacturers which means if you have used computerized machine quilting then you most likely used one they created even if their name is not on it.</p>\r\n\r\n<p>With numerous testimonials from thousands of satisfied customers, The Grace Company has led the way for those who wish to continue combining traditional quilting methods with today\'s technology. And for those who have used the equipment as well as those who have viewed the masterpieces that have been made, the results speak for themselves.</p>', 'The Grace Company', 'The Grace Company. Over the past 25 years, The Grace Company has taken innovation and invention to entirely new levels with its commitment to integrating the worlds of quilting and technology.  ', 'publish', 'closed', 'closed', '', 'the-grace-company', '', '', '2015-05-28 19:12:05', '2015-05-29 01:12:05', '', '2855', 'http://www.qniquequilter.com/?page_id=2854', '0', 'page', '', '0');
INSERT INTO `qn_posts` VALUES ('2855', '7', '2015-03-23 13:08:17', '2015-03-23 19:08:17', '<h2 itemprop=\"hasPart about\">The Qnique Quilter Makes it Easy to Create Quilting Masterpieces</h2>\r\n<p>From early times women have sewn quilts from leftover bits of fabric to cover their beds and keep their families warm, but the sewing was done by hand since they did not have sewing machines then. The work was tedious and it took many hours to finish just one quilt. Women often got help from their neighbors and family members to finish the quilt in just one day, and each member of the group got help in making their own quilt. These gatherings were known as quilting bees, and served as social activities as well as work days.</p>\r\n\r\n<p>The modern sewing machine has made sewing a quilt much faster and easier than in pioneer days, but it is still necessary for a quilter to learn the intricate details of the art. It takes much more than looking through pattern books to find the right piece and then following the directions to make the quilt. Today\'s quilting machine is equipped with multiple accessories, so the operator must learn how to use them correctly.</p>\r\n\r\n<p>The intricate stitches needed to create beautiful patterns on quilts should be uniform in length and consistency, and the Qnique Quilting Machine\'s built-in regulation ensures perfect stitches. Highly detailed patterns are not difficult to create using this state of the art machine that uses laser technology to exactly follow the outline of images or patterns. Learning to use the <a href=\"http://www.qniquequilter.com\" title=\"Qnique Quilter\" rel=\"follow index\">Qunique Quilter</a> is relatively easy by following the directions in the instruction books that are included, and online advice is always available.</p>\r\n\r\n<p>The Qnique Quilter is a state of the art machine that gives the operator all the tools needed to create pieces that are beautiful enough to sell at craft shows or online. Many women even find a satisfying career in making and selling quilts, and the <strong>Qnique quilting machine</strong> can make this occupation much easier and more profitable. People who sew quilts and accessories at home to sell at shows or online are able to turn out more finished projects when they have a quilting frame. This modern machine is designed to work perfectly on many existing frames, and includes at complete set of instructions to set it up on various quilting frames.</p>\r\n\r\n<p>Considering the many benefits of owning a Qnique Quilting Machine, prospective buyers might be concerned about its high cost. The cost of comparable longarm quilting machines typically falls between $6,000 to $18,000, but the Qnique Quilter can be purchased for less than any other long arm quilting machine on the market today. With this incredibly reasonable price the Qnique offers all the advantages of the higher price machines, plus finger-tip controls for ease of operation. Although the Qnique is not classified as a long-arm machine, its 15\" throat length offers the operator the ability to sew most patterns effortlessly.</p>\r\n\r\n<p>Quilting is a creative hobby that many women enjoy, and they make lovely quilts and accessories for their own home or as gifts. Other women have begun to sell their beautiful projects at shows, in a local quilt shop or online. Unless a quilter is focused on sewing and selling quilts and accessories as a career, she may not have considered purchasing a quilting machine for her home. However, the reasonable cost and high performance level of the Qnique Quilting Machine could make the purchase a possibility. Although it is not likely that anyone who purchases this machine would want to return it, the company policy does have a return policy due to defects with or dissatisfaction with its performance.</p>', 'About The Qnique Quilting Machine', 'Quilters will love the many advantages of owning a Qnique Quilter, and the many beautiful projects they can create.', 'publish', 'closed', 'closed', '', 'about', '', '', '2015-05-28 18:17:33', '2015-05-29 00:17:33', '', '0', 'http://www.qniquequilter.com/?page_id=2855', '3', 'page', '', '0');
