INSERT INTO `qn_posts` VALUES ('2915', '4', '2015-05-11 08:30:52', '2015-05-11 14:30:52', '<h2>Qnique Quilter 14+: The exciting new mid-arm for home or business</h2>\r\nA mid-arm machine fills that just right spot between a domestic sewing machine and a long-arm quilter. Until now, however, the mid-arm buyer had to sacrifice many of the features that the long-arm offered. The Qnique Quilter 14+ provides everything one would expect from a mid-arm, plus many functions that until now had been the exclusive hallmarks of larger, much more expensive machines.\r\n[br][br]\r\nThe Qnique Quilter 14+ has a 15-inch throat space to accommodate large patterns and blocks. Its durable metal body can be used with many frames, including Gracie and Bernina models. The 14+ is also compatible with Quilters Creative Touch Software and QuiltMotion, so the precision and control of computerized design and stitching are available to the quilter who enjoys them.\r\n[br][br]\r\nThis machine can operate at a stitching rate of 1800 stitches per minute; the stitch length is regulated to stay consistent when the user speeds up or slows down. All the main settings can be controlled from the handles by using six quick-access buttons. A clear, full-color LED display on the front of the machine keeps every setting easily visible.\r\n[br][br]\r\nThe Qnique Quilter 14+ has the advantage of four different stitch modes. The precise mode allows control of the stitches per inch setting. The cruise mode adds the ability to set a minimum speed which the machine will maintain even if the operator releases the controls. Baste mode gives the option of short, medium and long basting stitches, and manual mode allows control of the stitching speed.\r\n[br][br]\r\nOther handy features of the 14+ include dual thread towers and an easy-access bobbin in a larger size. There is also a convenient button to raise or lower the needle; this button can be used to set a needle stop position.\r\n[br] \r\n\r\n\r\n[br]\r\nThe Qnique Quilter 14+ is packed with features in an accommodating size at an attractive price. This mid-arm quilting machine combined with the skill and creativity of a modern quilter is sure to result in beautiful and satisfying products for the home or business.\r\n[br]\r\n<a href=\" http://www.qniquequilter.com/features/\" class=\"small-action-button\">See Full Details</a>[br]\r\n[br]\r\n<ul class=\"flex-container\">\r\n<li class=\"flex-item\"><a href=\"https://twitter.com/QniqueQuilter\" class=\"small-action-button inline\" target=\"_blank\">Twitter: @QniqueQuilter</a></li>\r\n<li class=\"flex-item\"><a href=\"https://www.facebook.com/QniqueQuilter\" class=\"small-action-button inline\" target=\"_blank\">FaceBook: QniqueQuilter</a></li>\r\n</ul>\r\n[br]', 'Qnique 14+ Quilter', 'The Qnique Quilter 14+ / quilting machine is a bold new breakthrough into the mid-arm category. Brought to you by the Grace Company, an industry leader in frames and accessories, the Qnique Quilter combines the features of a long-arm machine with the size and affordability of a mid-arm.\r\n[br]<br />\r\nThis new affordable mid-arm quilter is loaded with professional features normally reserved for more expensive quilting machines.<br /><br />\r\n<h3>Compatible Quilting Frames</h3>\r\n<ul>\r\n<li>Majestic</li>\r\n<li>Gracie King & Queen</li>\r\n<li>SR-2 Quilting Frame</li>\r\n<li>Pinnacle</li>\r\n<li>GMQ Frame</li>\r\n<li>Little Gracie II</li>\r\n<li>Next Generation</li>\r\n<li>iQuilt Frame</li>\r\n<li>Bernina Frame</li>\r\n</ul>', 'inherit', 'open', 'open', '', '1218-autosave-v1', '', '', '2015-05-11 08:30:52', '2015-05-11 14:30:52', '', '1218', 'http://www.qniquequilter.com/1218-autosave-v1/', '0', 'revision', '', '0');
