INSERT INTO `qn_posts` VALUES ('2918', '0', '2015-04-17 17:12:24', '2015-04-17 23:12:24', 'i am insterested in obtaining a mid  or longarm quilting machine. i currently have the grace majestic quilt bed, but find it difficult to quilt with the nina short arm machine supplied with the quiltbed by bernina s.a.  i live in south africa near johannesburg and many of the machines available, eg pfaff powerquilter p3 annot be used here because of the difference in the power supply. so i need to know when  the q\'nique machine will be available here. also id like an idea of what the price range will be. your co-opertation will be appreciated \r\n', 'eugene gonsalves', '', 'publish', 'open', 'open', '', 'eugene-gonsalves', '', '', '2015-04-17 17:12:24', '2015-04-17 23:12:24', '', '0', 'http://www.qniquequilter.com/?cx_offline_msg=eugene-gonsalves', '0', 'scx_offline_msg', '', '0');
