INSERT INTO `qn_posts` VALUES ('3779', '3', '2015-10-02 13:34:04', '2015-10-02 19:34:04', '<h2 itemprop=\"hasPart about\">Qnique user in UK has this great blog, check it out.</h2>\r\n<h3 class=\"post-title entry-title\" itemprop=\"name\">Review of Q\'nique Quilting Machine.</h3>\r\n \r\n<div class=\"post-body entry-content\" id=\"post-body\" itemprop=\"description articleBody\">\r\n<p>I\'ve had my Q\'nique now for a few weeks and we are getting along just fine. The Q\'nique 14+ is a quilting machine made by<a href=\"http://www.qniquequilter.com/\">the Grace Company</a>. It has almost 15\" of quilting space hence it is called the 14+.</p>\r\n<br /> <br />\r\n<div class=\"separator\">\r\n <img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01192.JPG\" />\r\n</div>\r\n<p>My set up before I got this machine was a Janome 1600P on a queen Gracie frame. The Q\'nique was designed to go on the Grace frame and to get the 14+ to sit on the frame, the professional carriage is required. Luckily I had this. The top section with the handles comes off and then encoders are added.</p>\r\n<p>My husband, who is an engineer was able to do this with ease.</p><br />\r\n<p>I would not have been able to do this myself but customer support has been fantastic.</p><br />\r\n\r\n<p>  At this point I should say I live in the UK and bought my machine from<a rel=\"index follow\" href=\"http://www.cottonpatch.co.uk/acatalog/Machine_Quilting_Frames.html\">The Cotton Patch</a>who are situated in Birmingham. Geoff and the team have been great as regards to follow up calls, making sure everything is ok.</p>\r\n<br />\r\n\r\n<p>You can also chat live online. to the guys from The Grace co, which is great.</p><br />\r\n\r\n<p>Now back to the machine, I don\'t really know where to start. the best thing has to be the huge arm space. After 2 years of working within a 7\" or less space, it is a massive luxury to have this extra space and is the main reason the machine was bought.</p>\r\n<div class=\"separator\">\r\n <img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01152.JPG\" />\r\n</div>\r\n<p>I have my frame set up to work from the front as I only do freehand work, no pantos.</p>\r\n<div class=\"separator\">\r\n <img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01194.JPG\" />\r\n \r\n</div>\r\n\r\n<p>The controls are at your finger tips in the handles which are at comfortable angle and you can see all your settings on this screen. There are 4 different sewing modes.\r\nI am using the precise regulated for designs like feathers but I also like the manual mode for doing designs like pebbling or stippling.</p>\r\n<div class=\"separator\">\r\n <img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC011931.jpg\" />\r\n</div>\r\n<pAnother feature I love is the counter. the machine records how many stitches and also how many hours quilting for each quilt or piece of work. this can be reset for each project.</p>\r\n<br />\r\n<p>It also has a counter for the total stitches and time worked on the machine, this cannot be reset.</p>\r\n<br />\r\n<div class=\"separator\">\r\n <img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01195.JPG\" />\r\n</div>\r\n<p>The bobbin winder is a separate motor and winds the big M class bobbins within 30 seconds! I love the big bobbins, they last a long time.</p>\r\n<br />\r\n<div class=\"separator\">\r\n \r\n<img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01196.JPG\" />\r\n</div>\r\n<p>The bobbin area itself is easily accessible for cleaning with no lids to remove. It is quick and easy. I use a soft, long handled artists brush to clean out the lint.</p>\r\n<br />\r\n<div class=\"separator\">\r\n \r\n<img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01197.JPG\" />\r\n</div>\r\n<p>I have had a few tension issues but have been able to resolve them myself. I\'ve discovered that the machine can be a bit fussy with the threads it likes. It does not like the poly core quilting thread I was using. Too linty. Tried a 100% polyester thread and it was fine.</p>\r\n<br />\r\n<p> Coming in at around 4250 in the UK, this machine is affordable. 10,000 for a long arm was NEVER going to be an option for me unless I won the lottery.</p>\r\n<br />\r\n<em><strong>I am truly happy with the Q\'nique and would recommend it to anyone.</strong></em>\r\n<br />\r\n<p>Here are some samples of my quilting done with the Q\'nique so far.</p>\r\n<br />\r\n<div class=\"separator\">\r\n \r\n	<img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01050.JPG\" /> \r\n</div>\r\n<br />\r\n<div class=\"separator\">\r\n \r\n	<img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01087.JPG\" />\r\n</div>\r\n<br />\r\n<div class=\"separator\">\r\n \r\n	<img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01091.JPG\" />\r\n</div>\r\n<br />\r\n<div class=\"separator\">\r\n \r\n	<img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01109.JPG\" />\r\n</div>\r\n<br />\r\n<div class=\"separator\">\r\n \r\n	<img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01151.JPG\" /> \r\n</div>\r\n<br />\r\n<div class=\"separator\">\r\n \r\n	<img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01147.JPG\" /> \r\n</div>\r\n <br />\r\n<div class=\"separator\">\r\n \r\n	<img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01219.JPG\" /> \r\n</div>\r\n<div class=\"separator\">\r\n \r\n	<img border=\"0\" src=\"http://www.qniquequilter.com/wp-content/uploads/2015/10/DSC01220.JPG\" />\r\n</div>\r\n<br />\r\nIf you are thinking of buying a Q\'nique, go and try one. If you are a quilter like me, you will love it!!<br />\r\nCredit goes to:<br />\r\n<a href=\"https://www.facebook.com/rhianon.taylor\" data-hovercard=\"/ajax/hovercard/user.php?id=1587943222\" aria-owns=\"js_2g\" aria-haspopup=\"true\" aria-describedby=\"js_2h\" id=\"js_2i\" rel=\"index follow\">Rhianon Taylor</a><br />\r\n<a rel=\"index follow\" href=\"http://rhianontaylor.blogspot.co.uk/2015/09/review-of-qnique-quilting-machine.html\" target=\"_blank\">http://rhianontaylor.blogspot.co.uk/2015/09/review-of-qnique-quilting-machine.html</a><br />\r\n</div>', 'Great Qnique Quilter Review !', 'Great review for the Qnique from one of our facebook pages we wanted to share with you. <br />\r\n\"I\'ve had my Q\'nique now for a few weeks and we are getting along just fine.<br />\r\nThe Q\'nique 14+ is a quilting machine made by&nbsp;<a href=\"http://www.qniquequilter.com/\">the Grace Company</a>. It has almost 15\" of quilting space hence it is called the 14+.', 'publish', 'open', 'open', '', 'great-qnique-quilter-review', '', '\nhttp://rhianontaylor.blogspot.co.uk/2015/09/review-of-qnique-quilting-machine.html', '2015-10-02 13:38:53', '2015-10-02 19:38:53', '', '0', 'http://www.qniquequilter.com/?p=3779', '0', 'post', '', '6');
