INSERT INTO `qn_posts` VALUES ('3811', '0', '2015-10-14 16:59:33', '2015-10-14 22:59:33', 'Q\'nique  tension will not stay adjusted.  Sews 1-2 inches, then starts looping, then sew \r\ninch or two..  Adjusted for thread\r\ntypes........The top tension just flops on the screw/spring.  No tension, can\'t be adjusted as screw doesn\'t have enough threads..  Really should not needed if lower tension worked., but machine is non-functional.  Moved slowly,\r\nfaster (loops on curves) changes stitches per inch.......\r\nclueless.  Followed all instructions and adjusted bobbin also.....', 'Rita Kyle', '', 'publish', 'closed', 'closed', '', 'rita-kyle', '', '', '2015-10-14 16:59:33', '2015-10-14 22:59:33', '', '0', 'http://www.qniquequilter.com/?cx_offline_msg=rita-kyle', '0', 'scx_offline_msg', '', '0');
