INSERT INTO `qn_posts` VALUES ('4036', '0', '2016-07-02 14:17:01', '2016-07-02 20:17:01', 'I bought my Qnique in April and have spent countless HOURS trying to get good tension.   Glenn even sent me a new upper tension dial.  I was able to get somewhat good tension (still has railroad tracks on back)  on the first 2 quilts.  I used cone thread.  When I changed to spool thread for the third quilt the tension was completely off. (eyelashes and railroad tracks and the feel of \"braille like\" stitches on back).  It took me about 6 hours to get the tension back again AND only with the cone thread.  (still has top thread showing thru on back but no eyelashes)\r\n1. Does this mean that I can only use cone thread?\r\nWhy do I continue to have the railroad tracks on back?  Top tension dial is turned almost to end to the left but when I loosen the bobbin tension, it gets very bumpy (again braille like on back) and loopy stitches on top.\r\n\r\nPlease help as I am VERY Frustrated but feel once I get the tension correct, I will love the machine. \r\n\r\nThank You, \r\nKaren Schiaroli \r\n', 'Karen Schiaroli', '', 'publish', 'closed', 'closed', '', 'karen-schiaroli', '', '', '2016-07-02 14:17:01', '2016-07-02 20:17:01', '', '0', 'http://www.qniquequilter.com/?scx_offline_msg=karen-schiaroli', '0', 'scx_offline_msg', '', '0');
INSERT INTO `qn_posts` VALUES ('4037', '0', '2016-07-03 18:51:43', '2016-07-04 00:51:43', 'I purchased the Qnique @ the Houston quilt show. Was shipped the end of December 2015. I had my home rewired and new floors done in my home so I just unpacked the boxes and assembled the frame and encoders yesterday. Today, I did a sample piece and it\'s great going to put on a small quilt and it\'s atrocious. What am I doing wrong.  I have long armed quilted for many years and now I\'m almost bald from pulling my hair out. Just joking on hair ... there is more gray. I work the hours that you are open and I am off when you are closed. I have looked at every u-tube video. It\'s just not working for me. Thanks. Veta Kirsch', 'Veta Kirsch', '', 'publish', 'closed', 'closed', '', 'veta-kirsch', '', '', '2016-07-03 18:51:43', '2016-07-04 00:51:43', '', '0', 'http://www.qniquequilter.com/?scx_offline_msg=veta-kirsch', '0', 'scx_offline_msg', '', '0');
